(149, 'theme_mods_hestia', 'a:52:{s:18:\"custom_css_post_id\";i:149;s:18:\"nav_menu_locations\";a:2:{s:7:\"primary\";i:2;s:6:\"footer\";i:3;}s:18:\"hestia_page_editor\";s:1293:\"<div class=\"col-md-12 suite-presentation\">\r\n<h3 style=\"text-align: center\">Suite O-rizon</h3>\r\n\r\n<div class=\"container\">\r\n<div class=\"row\" style=\"text-align:center\">\r\n<div class=\"col-xs-6 col-md-4\"><a href=\"/orizon/etudiant\"><img src=\"http://o-rizon.eu/wp-content/uploads/2018/06/computer-1185626_640-300x200.jpg\" /><p>O-rizon S (Étudiant)</p></a></div>\r\n<div class=\"col-xs-6 col-md-4\"><a href=\"/orizon/administration-vie-scolaire\"><img src=\"http://o-rizon.eu/wp-content/uploads/2018/06/analytics-2618277_640-300x200.jpg\" /><p>O-rizon ASL (Administration)</p></a></div>\r\n<div class=\"col-xs-6 col-md-4\"><a href=\"/orizon/professeur\"><img src=\"http://o-rizon.eu/wp-content/uploads/2018/06/laptop-2411303_640-300x200.jpg\" /><p>O-rizon T (Professeur)</p></a></div>\r\n<div class=\"col-xs-offset-0 col-xs-6 col-md-offset-2 col-md-4\"><a href=\"/orizon/conseiller-orientation\"><img src=\"http://o-rizon.eu/wp-content/uploads/2018/06/bulletin-board-3233653_640-300x186.jpg\" /><p>O-rizon C (Conseiller d\'orientation)</p></a></div>\r\n<div class=\"col-xs-offset-3 col-xs-6 col-md-offset-0 col-md-4\"><a href=\"/orizon/parent\"><img src=\"http://o-rizon.eu/wp-content/uploads/2018/06/adult-3086304_640-300x200.jpg\" /><p>O-rizon P (Parent)</p></a></div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n</div>\";s:24:\"hestia_feature_thumbnail\";s:63:\"http://o-rizon.eu/wp-content/uploads/2018/06/images-1.jpg\";s:13:\"show_on_front\";s:4:\"page\";s:27:\"hestia_big_title_background\";s:58:\"http://o-rizon.eu/wp-content/uploads/2018/06/ex3.jpg\";s:22:\"hestia_big_title_title\";s:7:\"O-rizon\";s:21:\"hestia_big_title_text\";s:44:\"S\'orienter n\'aura jamais été aussi simple.\";s:28:\"hestia_big_title_button_text\";s:0:\"\";s:18:\"hestia_ribbon_hide\";b:1;s:23:\"hestia_clients_bar_hide\";b:1;s:1