Image\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"https://siteorigin.com/adding-form-hero-image/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://siteorigin.com/adding-form-hero-image/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 12 Sep 2018 12:24:49 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:8:\"Tutorial\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"tutorial\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=126657\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:483:\"<p>Adding a form to your hero image is a great way to turn user attention into action. In this tutorial, we\'ll cover how to use Page Builder by SiteOrigin and the SiteOrigin Widgets Bundle to add a hero image (using the Layout Slider widget) and a contact form to your page.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/adding-form-hero-image/\">Adding a Form to a Hero Image</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:11643:\"<p>Adding a form to your hero image is a great way to turn user attention into action. In this tutorial, we&#8217;ll cover how to use Page Builder by SiteOrigin and the SiteOrigin Widgets Bundle to add a hero image (using the Layout Slider widget) and a contact form to your page.</p>\n<p><a href=\"https://demo.siteorigin.com/corp/hero-with-form-right/\">View the demo</a>.</p>\n<h3>Required Plugins</h3>\n<p><a href=\"https://wordpress.org/plugins/siteorigin-panels/\">Page Builder by SiteOrigin</a><br />\n<a href=\"https://wordpress.org/plugins/so-widgets-bundle/\">SiteOrigin Widgets Bundle</a></p>\n<p>Once Page Builder and the Widgets Bundle are activated, go to <span class=\"adminized-section\"><span class=\"adminized-part\">Plugins</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">SiteOrigin Widgets</span></span> and make sure that the <strong>Layout Slider</strong>, <strong>Headline</strong> and <strong>Contact Form</strong> widgets are activated.</p>\n<h3>Getting Started</h3>\n<p>Go to Pages and edit the page you&#8217;d like to insert your hero into. If you haven&#8217;t activated Page Builder on this page yet, click on the Page Builder tab and then in the Page Builder toolbar, click the Add Row button and add a single column row to your page. While editing the row, click the Layout tab on the right and set the Row Layout to Full Width Stretched.</p>\n<p>Next, select the row you&#8217;ve just created and click the Add Widget button. Because we need a Layout Builder within our hero we&#8217;re going to use the SiteOrigin Layout Slider widget. After clicking Add Widget, use the search bar at the top left to search for the SiteOrigin Layout Slider widget and insert it.</p>\n<p><img src=\"https://siteorigin.com/wp-content/uploads/2018/09/layout-slider-widget.png\" alt=\"\" width=\"2398\" height=\"402\" class=\"alignnone size-full wp-image-127584\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/09/layout-slider-widget.png 2398w, https://siteorigin.com/wp-content/uploads/2018/09/layout-slider-widget-300x50.png 300w, https://siteorigin.com/wp-content/uploads/2018/09/layout-slider-widget-768x129.png 768w, https://siteorigin.com/wp-content/uploads/2018/09/layout-slider-widget-699x117.png 699w, https://siteorigin.com/wp-content/uploads/2018/09/layout-slider-widget-1050x176.png 1050w, https://siteorigin.com/wp-content/uploads/2018/09/layout-slider-widget-313x52.png 313w\" sizes=\"(max-width: 2398px) 100vw, 2398px\" /></p>\n<h3>Setting up the Layout Slider</h3>\n<p>Click on the SiteOrigin Layout Slider widget and then the edit link to open it. Before adding a frame, click on the Design and Layout tab to enter a few basic setup settings. For our <a href=\"https://demo.siteorigin.com/corp/hero-with-form-right/\">demo</a>, we&#8217;ve used the following:</p>\n<p><strong>Height:</strong> <code>780px</code><br />\n<strong>Top and bottom padding:</strong> <code>140px</code><br />\n<strong>Extra top padding:</strong> <em>Not populated</em><br />\n<strong>Side padding:</strong> <code>20px</code><br />\n<strong>Maximum container Width:</strong> <code>80%</code><br />\n<strong>Heading color:</strong> <code>#fff</code><br />\n<strong>Heading size:</strong> <code>54px</code><br />\n<strong>Heading shadow intensity:</strong> <code>50</code><br />\n<strong>Text size:</strong> <code>22px</code><br />\n<strong>Text color:</strong> <code>#fff</code></p>\n<p><img src=\"https://siteorigin.com/wp-content/uploads/2018/09/design-and-layout-574x699.png\" alt=\"\" width=\"574\" height=\"699\" class=\"alignnone size-large wp-image-127587\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/09/design-and-layout-574x699.png 574w, https://siteorigin.com/wp-content/uploads/2018/09/design-and-layout-246x300.png 246w, https://siteorigin.com/wp-content/uploads/2018/09/design-and-layout-768x936.png 768w, https://siteorigin.com/wp-content/uploads/2018/09/design-and-layout-862x1050.png 862w, https://siteorigin.com/wp-content/uploads/2018/09/design-and-layout-313x381.png 313w, https://siteorigin.com/wp-content/uploads/2018/09/design-and-layout.png 1244w\" sizes=\"(max-width: 574px) 100vw, 574px\" /></p>\n<h4>Adding a Frame and Contents</h4>\n<p>As with all SiteOrigin slider widgets, multiple frames (slides) can be added. In this example, we&#8217;ll just be adding a single frame. Click the Add link in the Slider Frames section to add a frame. Start out by opening the Background section and adding a background image. In our demo we&#8217;ve used:</p>\n<p><strong>Background image type:</strong> <code>Cover</code><br />\n<strong>Background image opacity:</strong> <code>20</code><br />\n<strong>Background color:</strong> <code>#000</code></p>\n<p>Our demo background images were sourced from <a href=\"https://unsplash.com/\">Unsplash</a>.</p>\n<p>With our frame background added, it&#8217;s time to add a headline and contact form. Click the Open Builder button, this will open a mini-instance of Page Builder. To set up your content, follow these steps:</p>\n<div id=\"attachment_127443\" style=\"width: 159px\" class=\"wp-caption alignright\"><img class=\"wp-image-127443 size-medium\" src=\"https://siteorigin.com/wp-content/uploads/2018/09/edit-row-149x300.png\" alt=\"\" width=\"149\" height=\"300\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/09/edit-row-149x300.png 149w, https://siteorigin.com/wp-content/uploads/2018/09/edit-row-348x699.png 348w, https://siteorigin.com/wp-content/uploads/2018/09/edit-row-522x1050.png 522w, https://siteorigin.com/wp-content/uploads/2018/09/edit-row-313x629.png 313w, https://siteorigin.com/wp-content/uploads/2018/09/edit-row.png 614w\" sizes=\"(max-width: 149px) 100vw, 149px\" /></p>\n<p class=\"wp-caption-text\">Set row top padding to 100 and mobile padding to 0.</p>\n</div>\n<p>1. Click the Add Row button. For our demo we added a single row with two columns. Click and drag the column divider to change the widths. We&#8217;ve used <code>60%</code> for the left column and <code>40%</code> for the right. While editing the row, click the Layout tab on the right and set <code>100</code> for the top padding and <code>0</code> for right, bottom and left. Set Mobile Padding to <code>0</code>.</p>\n<p>2. Insert your widgets. Click on the left cell, then click the Add Widget button, use the search form at the top left to search for the SiteOrigin Headline widget. Repeat the same process for the right cell and insert the SiteOrigin Contact Form widget.</p>\n<p>3. Edit the Headline widget. Open the Headline section and insert your headline text, we&#8217;ve used <code>H1</code> for the headline HTML tag. For SEO your page should only contain one <code>H1</code> tag. If you&#8217;re using a <code>H1</code> tag anywhere else on your page then it&#8217;s best to make this <code>H2</code> or <code>H3</code> depending on your content structure. Next, open the Sub headline section and insert your sub headline. We&#8217;ve used <code>Paragraph</code> for the HTML tag. Finally, open the Divider section. We&#8217;ve set the Style setting <code>None</code> as we aren&#8217;t using the divider in this example. Click Done to save your changes.</p>\n<p>4. Edit the Contact Form widget. The Contact Form widget is quite settings rich so it might take a few moments to set up. Open the Settings section to set up your form basics such as email addresses, subject, success message and send button text. Next, add form fields as required. In our example, we&#8217;ve used a text field for name and an email address field. Finally, open the Design section and style your form as required. Once complete, click Done to save the Contact Form widget and then Done again to save the Layout Builder, lastly, click Done to save and exit the Layout Slider widget and then publish or update your page.</p>\n<div id=\"attachment_127593\" style=\"width: 3220px\" class=\"wp-caption alignnone\"><img src=\"https://siteorigin.com/wp-content/uploads/2018/09/layout-builder.png\" alt=\"\" width=\"3210\" height=\"424\" class=\"size-full wp-image-127593\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/09/layout-builder.png 3210w, https://siteorigin.com/wp-content/uploads/2018/09/layout-builder-300x40.png 300w, https://siteorigin.com/wp-content/uploads/2018/09/layout-builder-768x101.png 768w, https://siteorigin.com/wp-content/uploads/2018/09/layout-builder-699x92.png 699w, https://siteorigin.com/wp-content/uploads/2018/09/layout-builder-1050x139.png 1050w, https://siteorigin.com/wp-content/uploads/2018/09/layout-builder-313x41.png 313w\" sizes=\"(max-width: 3210px) 100vw, 3210px\" /></p>\n<p class=\"wp-caption-text\">Layout Builder contents</p>\n</div>\n<h3>Enhanced by SiteOrigin Premium</h3>\n<p><a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> is a plugin that adds additional settings and functionality to SiteOrigin widgets, Page Builder and SiteOrign themes. It also includes our quick and helpful email support service. The following SiteOrigin Premium addons could be applied to engage users and provide additional functionality:</p>\n<p><strong>Block Animations</strong><br />\nThe Block Animations addon offers animation settings for rows and widgets. We&#8217;ve created a <a href=\"https://demo.siteorigin.com/corp/hero-with-form-right-block-animations/\">demo</a> showing a simple widget fade in with a slight delay. Read more about the settings available in the SiteOrigin Premium Block Animations addon it the <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/block-animations/\">documentation</a>.</p>\n<p><strong>Parallax Sliders</strong><br />\nThe Parallax Sliders addon offers parallax scrolling for the SiteOrigin Slider, Hero, and Layout Slider widget. We&#8217;ve created a <a href=\"https://demo.siteorigin.com/corp/hero-with-form-right-parallax-sliders/\">demo</a> showing the Layout Slider with a parallax scrolling effect. Read more about the settings available in the SiteOrigin Premium Parallax Sliders addon it the <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/parallax-sliders/\">documentation</a>.</p>\n<p><strong>Autoresponder</strong><br />\nThe SiteOrigin Premium Contact Form addon provides an autoresponder. Let users know you&#8217;ve received their email and provide a timeframe for response. Read more about the settings available in the SiteOrigin Contact Form addon in the <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/contact-form-fields/\">documentation</a>. </p>\n<h3>Using the Demo Layout</h3>\n<p><a href=\"https://demo.siteorigin.com/corp/hero-with-form-right/\">View the demo</a>.<br />\n<a href=\"https://siteorigin.com/wp-content/uploads/2018/09/hero-with-form-right.json\">Download the demo layout (JSON file)</a>.</p>\n<p>If you&#8217;d like to make use of the demo layout, follow these steps:</p>\n<p>1. Download the above JSON file to your desktop.<br />\n2. Go to the page you&#8217;d like to use, if you haven&#8217;t activated Page Builder on this page yet, click on the Page Builder tab and then in the Page Builder toolbar, click <span class=\"adminized-section\"><span class=\"adminized-part\">Layouts</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Import/Export</span></span>.<br />\n3. Upload the layout either by dragging and dropping or selecting it using the select button.<br />\n4. Finally, click the Insert button bottom right.</p>\n<p>If you have any questions or comments, please let us know below, we&#8217;d love to hear from you.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/adding-form-hero-image/\">Adding a Form to a Hero Image</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"https://siteorigin.com/adding-form-hero-image/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"5\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"One Page Navigation with Page Builder and Corp\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"https://siteorigin.com/one-page-navigation-with-page-builder-corp/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"https://siteorigin.com/one-page-navigation-with-page-builder-corp/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 25 Jul 2018 08:20:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:8:\"Tutorial\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"tutorial\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=119494\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:570:\"<p>One-page navigation allows users to easily access content in long landing pages or one-page websites. SiteOrigin Corp offers integrated one-page navigation with menu highlighting and smooth scroll. In this tutorial, we\'ll explain how to set up a one-page website or landing page using Page Builder by SiteOrigin and Corp.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/one-page-navigation-with-page-builder-corp/\">One Page Navigation with Page Builder and Corp</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:7720:\"<p>One-page navigation allows users to easily access content in long landing pages or one-page websites. SiteOrigin Corp offers integrated one-page navigation with menu highlighting and smooth scroll. In this tutorial, we&#8217;ll explain how to set up a one-page website or landing page using Page Builder by SiteOrigin and Corp.</p>\n<p><a href=\"https://demo.siteorigin.com/corp/one-page-demo/\">View the demo</a>.</p>\n<h3>Create Your Page</h3>\n<p>In this tutorial, we&#8217;ll be using the WordPress plugin <a href=\"https://wordpress.org/plugins/siteorigin-panels/\">Page Builder by SiteOrigin</a> and theme, <a href=\"https://wordpress.org/themes/siteorigin-corp/\">SiteOrigin Corp</a>.</p>\n<p>If you haven&#8217;t already created a page, go to <span class=\"adminized-section\"><span class=\"adminized-part\">Pages</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Add New</span></span>, create a new page and click on the Page Builder tab to get started. </p>\n<p>If you&#8217;d like to use the demo page content, you can <a href=\"https://siteorigin.com/wp-content/uploads/2018/07/one-page-demo-export.json\">download it here</a> (right click and save as). Import the JSON file from <span class=\"adminized-section\"><span class=\"adminized-part\">Layouts</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Import/Export</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Select Import File</span></span>.</p>\n<h3>Adding Row ID&#8217;s</h3>\n<p>One you have a populated page, either with your own content or with the demo content listed above, it&#8217;s time to insert our row ID&#8217;s. Row ID&#8217;s will be used to link to each section of the page. Edit the first row you&#8217;d like your menu to link to and click the Attributes tab on the right, use the Row ID field to insert an ID that&#8217;ll be used later in your menu. For example, in our demo, the first row we&#8217;re linking to is the Services row. The ID used is <code>services</code>. You can insert any name or number.</p>\n<p><img src=\"https://siteorigin.com/wp-content/uploads/2018/07/row-id.png\" alt=\"\" width=\"754\" height=\"474\" class=\"alignnone size-full wp-image-119817\" style=\"max-width:50%;\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/07/row-id.png 754w, https://siteorigin.com/wp-content/uploads/2018/07/row-id-300x189.png 300w, https://siteorigin.com/wp-content/uploads/2018/07/row-id-699x439.png 699w, https://siteorigin.com/wp-content/uploads/2018/07/row-id-313x197.png 313w\" sizes=\"(max-width: 754px) 100vw, 754px\" /></p>\n<p>Add a row ID for every row in your page that you&#8217;d like to link to.</p>\n<h3>Create Your Menu</h3>\n<p>Go to <span class=\"adminized-section\"><span class=\"adminized-part\">Appearance</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Menus</span></span>, click the &#8220;create a new menu&#8221; link if you don&#8217;t already have a menu added. Once named, save your menu to the Header Menu theme location. Next, add your anchor links, these will direct users to the various sections of your one-page website. Click the Custom Links tab on the left to add a link. In the URL field, add the name of your first section ID with a hash before it. For example, if the first row you&#8217;d like to link to has the ID <code>services</code>, you&#8217;d add <code>#services</code> to the URL field. The Link Text field is the text your users will see, insert the link text for the anchor you&#8217;re linking to.</p>\n<p><img src=\"https://siteorigin.com/wp-content/uploads/2018/07/custom-link.png\" alt=\"\" width=\"944\" height=\"1162\" class=\"alignnone size-full wp-image-119847\" style=\"max-width:50%;\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/07/custom-link.png 944w, https://siteorigin.com/wp-content/uploads/2018/07/custom-link-244x300.png 244w, https://siteorigin.com/wp-content/uploads/2018/07/custom-link-768x945.png 768w, https://siteorigin.com/wp-content/uploads/2018/07/custom-link-568x699.png 568w, https://siteorigin.com/wp-content/uploads/2018/07/custom-link-853x1050.png 853w, https://siteorigin.com/wp-content/uploads/2018/07/custom-link-313x385.png 313w\" sizes=\"(max-width: 944px) 100vw, 944px\" /></p>\n<h3>Creating One-Page Navigation in Multi-Page Website</h3>\n<p>Creating an anchor menu as we&#8217;ve described in the above paragraph is quite simple for a one-page website. But what if your one-pager is part of a larger website? In that case, you&#8217;d need a separate menu. In our Corp demo, we&#8217;ve done exactly that, the one-page demo has one menu and the rest of the website has another. If you&#8217;d like to know how this was done, read on. </p>\n<p>The plugin we&#8217;ve used for this is called <a href=\"https://wordpress.org/plugins/menu-items-visibility-control/\">Menu Items Visibility Control</a>. Once installed and activated, it adds a Visibility field to each menu item. In each menu item at <span class=\"adminized-section\"><span class=\"adminized-part\">Appearance</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Menus</span></span> we&#8217;ve set the visibility to either show or be hidden on the one-pager. To do this, you&#8217;ll need to know the ID of your one-pager. Go to Pages, edit the page concerned and check the URL, within the URL is a number, that&#8217;s the page ID. In the case of our demo, the ID is <code>288</code>. The below conditional statements can be used in your menu, simply replace our page ID (288), with yours.</p>\n<p><strong>Show this item on page ID 288</strong><br />\n<code>is_page( 288 )</code></p>\n<p><strong>Hide this item on page ID 288</strong><br />\n<code>! is_page( 288 )</code></p>\n<p><img src=\"https://siteorigin.com/wp-content/uploads/2018/07/menu-visibility.png\" alt=\"\" width=\"1346\" height=\"828\" class=\"alignnone size-full wp-image-119852\" style=\"width:75%\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/07/menu-visibility.png 1346w, https://siteorigin.com/wp-content/uploads/2018/07/menu-visibility-300x185.png 300w, https://siteorigin.com/wp-content/uploads/2018/07/menu-visibility-768x472.png 768w, https://siteorigin.com/wp-content/uploads/2018/07/menu-visibility-699x430.png 699w, https://siteorigin.com/wp-content/uploads/2018/07/menu-visibility-1050x646.png 1050w, https://siteorigin.com/wp-content/uploads/2018/07/menu-visibility-313x193.png 313w\" sizes=\"(max-width: 1346px) 100vw, 1346px\" /></p>\n<p>If you&#8217;d prefer to have your one-page links visible throughout your site then there is no need to use Menu Item Visibility. An additional consideration is that users might access your one-page links from another page. To ensure your anchor links work, use absolute URLs when adding Custom Links to your menu. This means that instead of adding anchor links such as <code>#services</code>, you&#8217;ll need to add the page URL in addition to the anchor link. Using our Services example from earlier in this post, we&#8217;d add <code>http://demo.siteorigin.com/corp/one-page-demo/#services</code>.</p>\n<p><strong>Page URL:</strong> http://demo.siteorigin.com/corp/one-page-demo/<br />\n<strong>Anchor Link:</strong> #services<br />\n<strong>Combined URL:</strong> http://demo.siteorigin.com/corp/one-page-demo/#services</p>\n<p>Hopefully, you&#8217;ve found this post useful. Please, let us know if you have any questions below, we&#8217;ll do our best to assist.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/one-page-navigation-with-page-builder-corp/\">One Page Navigation with Page Builder and Corp</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://siteorigin.com/one-page-navigation-with-page-builder-corp/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"17\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"Announcing the Tooltip Addon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"https://siteorigin.com/announcing-the-tooltip-addon/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"https://siteorigin.com/announcing-the-tooltip-addon/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 17 Jul 2018 07:28:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:7:\"Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=118318\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:624:\"<p>The Tooltip addon for <a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> is here! Tooltips appear on hover or mouse click and are a great way to display additional image information without taking up space. To see the Tooltip addon in use, <a href=\"https://demo.siteorigin.com/premium/tooltip-addon/\" target=\"_blank\" rel=\"nofollow\">view the demo</a> and hover over any of the images.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/announcing-the-tooltip-addon/\">Announcing the Tooltip Addon</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1546:\"<p>The Tooltip addon for <a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> is here! Tooltips appear on hover or mouse click and are a great way to display additional image information without taking up space. To see the Tooltip addon in use, <a href=\"https://demo.siteorigin.com/premium/tooltip-addon/\" target=\"_blank\" rel=\"nofollow\">view the demo</a> and hover over any of the images.</p>\n<p>We first had the idea for a tooltip addon while building a portfolio website as part of a SiteOrigin <a href=\"https://siteorigin.com/pack/\">Site Pack</a>. Tooltips are an awesome addition for designers and photographers displaying their work or any image that needs a credit or additional information added on hover or click. The Tooltip addon is available for the SiteOrigin Image, Image Grid, and Simple Masonry widgets.</p>\n<p>If you&#8217;re already using SiteOrigin Premium and have updated to version 1.4.1, you can go to <span class=\"adminized-section\"><span class=\"adminized-part\">SiteOrigin</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Premium Addons</span></span> to activate and adjust the global settings. Find out more about how to use the Tooltip addon in the <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/tooltip/\">documentation</a>.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/announcing-the-tooltip-addon/\">Announcing the Tooltip Addon</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://siteorigin.com/announcing-the-tooltip-addon/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"Four New Blog Layouts Added to Corp Theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://siteorigin.com/four-new-blog-layouts-added-to-corp-theme/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://siteorigin.com/four-new-blog-layouts-added-to-corp-theme/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 27 Jun 2018 17:08:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:6:\"Themes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://siteorigin.com/?p=115595\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:524:\"<p>We\'re excited to announce four new blog layouts for our Corp theme. This brings the total available blog layouts to five. Choose between the following for your posts page, Standard, Grid, Offset, Alternate or Masonry. We\'ve also included a new search results layout in this update.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/four-new-blog-layouts-added-to-corp-theme/\">Four New Blog Layouts Added to Corp Theme</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:6940:\"<p>We&#8217;re excited to announce four new blog layouts for our latest theme, <a href=\"https://siteorigin.com/theme/corp\">Corp</a>. Choose the layout that&#8217;s the best fit for your blog and archive pages.</p>\n<p><a href=\"https://wordpress.org/themes/siteorigin-corp/\">Download Corp</a>, a fully featured free WordPress theme.<br />\n<a href=\"https://demo.siteorigin.com/corp/\">View the Corp demo</a>.</p>\n<h3>Standard Layout</h3>\n<p><a href=\"https://demo.siteorigin.com/corp/standard-blog-layout/\">View the demo</a>.</p>\n<p>The Standard layout features a classic blog look with a large featured image followed by a title, post meta, and content.</p>\n<p><a href=\"https://demo.siteorigin.com/corp/standard-blog-layout/\"><img class=\"alignnone size-large wp-image-115786\" src=\"https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-standard-633x699.jpg\" alt=\"\" width=\"633\" height=\"699\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-standard-633x699.jpg 633w, https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-standard-272x300.jpg 272w, https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-standard-768x848.jpg 768w, https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-standard-313x346.jpg 313w, https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-standard.jpg 770w\" sizes=\"(max-width: 633px) 100vw, 633px\" /></a></p>\n<h3>Grid Layout</h3>\n<p><a href=\"https://demo.siteorigin.com/corp/grid-blog-layout/\">View the demo</a>.</p>\n<p>This is the blog layout Corp launched with, it offers a structured grid pattern, great for blogs with lots of content.</p>\n<p><a href=\"https://demo.siteorigin.com/corp/grid-blog-layout/\"><img class=\"alignnone size-large wp-image-115787\" src=\"https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-grid-699x441.jpg\" alt=\"\" width=\"699\" height=\"441\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-grid-699x441.jpg 699w, https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-grid-300x189.jpg 300w, https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-grid-768x485.jpg 768w, https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-grid-313x198.jpg 313w, https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-grid.jpg 800w\" sizes=\"(max-width: 699px) 100vw, 699px\" /></a></p>\n<h3>Offset Layout</h3>\n<p><a href=\"https://demo.siteorigin.com/corp/offset-blog-layout/\">View the demo</a>.</p>\n<p>The Offset layout features the post author, categories and comment count in an offset left column, great for highlighting post author contributions.</p>\n<p><a href=\"https://demo.siteorigin.com/corp/offset-blog-layout/\"><img src=\"https://siteorigin.com/wp-content/uploads/2018/06/new-offset-layout-676x699.jpg\" alt=\"\" width=\"676\" height=\"699\" class=\"alignnone size-large wp-image-115801\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/06/new-offset-layout-676x699.jpg 676w, https://siteorigin.com/wp-content/uploads/2018/06/new-offset-layout-290x300.jpg 290w, https://siteorigin.com/wp-content/uploads/2018/06/new-offset-layout-768x794.jpg 768w, https://siteorigin.com/wp-content/uploads/2018/06/new-offset-layout-313x324.jpg 313w, https://siteorigin.com/wp-content/uploads/2018/06/new-offset-layout.jpg 800w\" sizes=\"(max-width: 676px) 100vw, 676px\" /></a></p>\n<h3>Alternate Layout</h3>\n<p><a href=\"https://demo.siteorigin.com/corp/alternate-blog-layout/\">View the demo</a>.</p>\n<p>This layout displays your post in horizontal containers, alternating the side the featured image is positioned on. Like the Grid layout, it&#8217;s also useful for active sites, looking to display more content on each page of their blog.</p>\n<p><a href=\"https://demo.siteorigin.com/corp/alternate-blog-layout/\"><img class=\"alignnone size-large wp-image-115783\" src=\"https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-alternate-699x489.jpg\" alt=\"\" width=\"699\" height=\"489\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-alternate-699x489.jpg 699w, https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-alternate-300x210.jpg 300w, https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-alternate-768x538.jpg 768w, https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-alternate-313x219.jpg 313w, https://siteorigin.com/wp-content/uploads/2018/06/corp-demo-alternate.jpg 800w\" sizes=\"(max-width: 699px) 100vw, 699px\" /></a></p>\n<h3>Masonry Layout</h3>\n<p><a href=\"https://demo.siteorigin.com/corp/masonry-blog-layout/\">View the demo</a>.</p>\n<p>The Masonry layout offers a more creative take on the grid layout. The post category is displayed on the featured image, the featured images aren&#8217;t uniform in height and when resizing the screen, the grid layout cascades into place.</p>\n<p><a href=\"https://demo.siteorigin.com/corp/masonry-blog-layout/\"><img src=\"https://siteorigin.com/wp-content/uploads/2018/06/new-masonry-corp-699x544.jpg\" alt=\"\" width=\"699\" height=\"544\" class=\"alignnone size-large wp-image-115806\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/06/new-masonry-corp-699x544.jpg 699w, https://siteorigin.com/wp-content/uploads/2018/06/new-masonry-corp-300x234.jpg 300w, https://siteorigin.com/wp-content/uploads/2018/06/new-masonry-corp-768x598.jpg 768w, https://siteorigin.com/wp-content/uploads/2018/06/new-masonry-corp-313x244.jpg 313w, https://siteorigin.com/wp-content/uploads/2018/06/new-masonry-corp.jpg 800w\" sizes=\"(max-width: 699px) 100vw, 699px\" /></a></p>\n<h3>Search Results</h3>\n<p>We&#8217;ve also improved Corp&#8217;s search results page. Search results now make use of a very similar layout to the Alternate post loop, just without the alternating featured image.</p>\n<p><img src=\"https://siteorigin.com/wp-content/uploads/2018/06/new-search-699x311.jpg\" alt=\"\" width=\"699\" height=\"311\" class=\"alignnone size-large wp-image-115803\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/06/new-search-699x311.jpg 699w, https://siteorigin.com/wp-content/uploads/2018/06/new-search-300x134.jpg 300w, https://siteorigin.com/wp-content/uploads/2018/06/new-search-768x342.jpg 768w, https://siteorigin.com/wp-content/uploads/2018/06/new-search-313x139.jpg 313w, https://siteorigin.com/wp-content/uploads/2018/06/new-search.jpg 800w\" sizes=\"(max-width: 699px) 100vw, 699px\" /></p>\n<h3>SiteOrigin Premium</h3>\n<p>If you&#8217;d like to remove the footer attribution, add Ajax comments and enjoy quick email support, SiteOrigin Premium is for you. <a href=\"https://siteorigin.com/downloads/premium/\">Find out more</a>.</p>\n<p>Corp is now a fully featured theme, complete with multiple blog loops and a completely customized WooCommerce design. If you have any questions or requests, please let us know below.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/four-new-blog-layouts-added-to-corp-theme/\">Four New Blog Layouts Added to Corp Theme</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://siteorigin.com/four-new-blog-layouts-added-to-corp-theme/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"8\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"Create a Fullscreen Slider with the SiteOrigin Hero Widget\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://siteorigin.com/create-fullscreen-slider-siteorigin-hero-widget/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"https://siteorigin.com/create-fullscreen-slider-siteorigin-hero-widget/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 08 Jun 2018 10:59:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:8:\"Tutorial\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:8:\"tutorial\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://siteorigin.com/?p=113044\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:442:\"<p>This guide will outline how to create a fullscreen slider with the SiteOrigin Hero widget and how you can take your fullscreen slider to the next level with SiteOrigin Premium.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/create-fullscreen-slider-siteorigin-hero-widget/\">Create a Fullscreen Slider with the SiteOrigin Hero Widget</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Alex S\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:11224:\"<p>This guide will outline how to create a fullscreen slider with the SiteOrigin Hero widget and how you can take your fullscreen slider to the next level with <a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a>.</p>\n<h3>Let&#8217;s Get Started</h3>\n<p>We&#8217;ll be using <a href=\"https://wordpress.org/plugins/siteorigin-panels/\">Page Builder by SiteOrigin</a> and the <a href=\"https://wordpress.org/plugins/so-widgets-bundle/\">SiteOrigin Widgets Bundle</a> plugins. You can check these plugins are activated from the Plugins menu item. Go to <span class=\"adminized-section\"><span class=\"adminized-part\">Plugins</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">SiteOrigin Widgets</span></span> and ensure the Hero widget is activated.<span id=\"more-113044\"></span></p>\n<p>Create a new page and enable Page Builder, or open an existing page. Add a new row and SiteOrigin Hero Image widget to that row. We need to set the row you&#8217;re using is set to Full Width Stretch, which will allow for the Hero widget to be the full width of the page. To do this, open the row containing the newly added Hero widget by clicking the wrench button above the row.</p>\n<p><img class=\"wp-image-113480 size-large aligncenter\" src=\"https://siteorigin.com/wp-content/uploads/2018/06/9PIZeAn-1-699x142.png\" alt=\"image with row wrench icon hovered on\" width=\"699\" height=\"142\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/06/9PIZeAn-1-699x142.png 699w, https://siteorigin.com/wp-content/uploads/2018/06/9PIZeAn-1-300x61.png 300w, https://siteorigin.com/wp-content/uploads/2018/06/9PIZeAn-1-768x156.png 768w, https://siteorigin.com/wp-content/uploads/2018/06/9PIZeAn-1-1050x213.png 1050w, https://siteorigin.com/wp-content/uploads/2018/06/9PIZeAn-1-313x64.png 313w, https://siteorigin.com/wp-content/uploads/2018/06/9PIZeAn-1-600x122.png 600w, https://siteorigin.com/wp-content/uploads/2018/06/9PIZeAn-1-1200x244.png 1200w, https://siteorigin.com/wp-content/uploads/2018/06/9PIZeAn-1.png 1486w\" sizes=\"(max-width: 699px) 100vw, 699px\" /></p>\n<p>Go to the Row Styles Sidebar on the right and open the Layout settings group. Set the <span class=\"adminized-section\"><span class=\"adminized-part\">Row Layout</span></span> to <span class=\"adminized-section\"><span class=\"adminized-part\">Full Width Stretched</span></span>. For reference, here&#8217;s what each row Layout does:</p>\n<p><img class=\"wp-image-113481 size-medium alignright\" src=\"https://siteorigin.com/wp-content/uploads/2018/06/Zgsowcb-1-1-300x208.png\" alt=\"Image of cursor on on the Row Layout drop-down\" width=\"300\" height=\"208\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/06/Zgsowcb-1-1-300x208.png 300w, https://siteorigin.com/wp-content/uploads/2018/06/Zgsowcb-1-1-313x217.png 313w, https://siteorigin.com/wp-content/uploads/2018/06/Zgsowcb-1-1-600x415.png 600w, https://siteorigin.com/wp-content/uploads/2018/06/Zgsowcb-1-1.png 662w\" sizes=\"(max-width: 300px) 100vw, 300px\" /></p>\n<p><strong>Standard:</strong> The standard layout provided by your theme.</p>\n<p><strong>Full Width:</strong> This row layout will stretch the row to the full width of the browser, and add a content container that&#8217;s sized based on the standard container. This row layout is perfect for making full-width backgrounds while still allowing the widgets within the row to maintain the consistent placement of the rest of the page.</p>\n<p><strong>Full Width Stretched:</strong> This row layout is the full width of the page. It&#8217;s perfect for making widgets (such as the Hero widget) full width rather than just the row background.</p>\n<p>Close the row and open the SiteOrigin Hero widget by hovering on top of the Hero widget and clicking edit.</p>\n<p><img class=\"wp-image-113483 size-large aligncenter\" src=\"https://siteorigin.com/wp-content/uploads/2018/06/ojjt7X0-1-699x112.png\" alt=\"image of hero widget with edit hovered on\" width=\"699\" height=\"112\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/06/ojjt7X0-1-699x112.png 699w, https://siteorigin.com/wp-content/uploads/2018/06/ojjt7X0-1-300x48.png 300w, https://siteorigin.com/wp-content/uploads/2018/06/ojjt7X0-1-768x123.png 768w, https://siteorigin.com/wp-content/uploads/2018/06/ojjt7X0-1-1050x168.png 1050w, https://siteorigin.com/wp-content/uploads/2018/06/ojjt7X0-1-313x50.png 313w, https://siteorigin.com/wp-content/uploads/2018/06/ojjt7X0-1-600x96.png 600w, https://siteorigin.com/wp-content/uploads/2018/06/ojjt7X0-1-1200x192.png 1200w, https://siteorigin.com/wp-content/uploads/2018/06/ojjt7X0-1.png 1488w\" sizes=\"(max-width: 699px) 100vw, 699px\" /></p>\n<p>Open the Design and Layout settings group and set the Height to <span class=\"adminized-section\"><span class=\"adminized-part\">100vh</span></span>. The <span class=\"adminized-section\"><span class=\"adminized-part\">V</span></span> in <span class=\"adminized-section\"><span class=\"adminized-part\">VH</span></span> stands for <a href=\"https://developer.mozilla.org/en-US/docs/Web/CSS/length#Viewport-percentage_lengths\">Viewport Percentage Length</a> and <span class=\"adminized-section\"><span class=\"adminized-part\">H</span></span> means height. Basically, <span class=\"adminized-section\"><span class=\"adminized-part\">100vh</span></span> is the entire height of the browser regardless of device so it&#8217;s exactly what you&#8217;re after for a fullscreen slider.</p>\n<p>That&#8217;s all the setup required to build fullscreen sliders with the SiteOrigin Hero widget. Now you simply need to set up the rest of the slider as desired &#8211; add content, tweak spacing, etc. As a point reference, for fullscreen sliders, we recommend using slide background images that are at least <span class=\"adminized-section\"><span class=\"adminized-part\">1920 x 1080</span></span> in dimensions. <span class=\"adminized-section\"><span class=\"adminized-part\">1920 x 1080</span></span> is an extremely popular resolution so it&#8217;ll cover the vast majority of use cases.</p>\n<h3>SiteOrigin Premium Enhancements</h3>\n<p><a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> adds a number of enhancements to your website and the Hero widget benefits greatly from these enhancements. You&#8217;re able to create a fullscreen slider with parallax with <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/parallax-sliders/\">the Parallax Sliders plugin addon</a> and add transitional Content Animations with the <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/hero/\">Hero plugin addon</a>. If you have SiteOrigin Premium, please ensure you&#8217;ve activated relevant functionality by navigating to <span class=\"adminized-section\"><span class=\"adminized-part\">SiteOrigin</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Premium Addons</span></span> and activating <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/parallax-sliders/\">Parallax Sliders</a> and <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/hero/\">Hero Addon</a>.</p>\n<h4>Fullscreen Parallax Sliders</h4>\n<p>SiteOrigin Premium adds the ability to allow your slide backgrounds to <a href=\"https://siteorigin.com/fixed-vs-parallax-background-images/\">parallax</a>. Before proceeding, it&#8217;s worth noting that parallax images require a vertically larger image than normal so ensure your image is vertically larger than you would normally use or the parallax effect may be very minor. We recommend using an image that&#8217;s more than <span class=\"adminized-section\"><span class=\"adminized-part\">1440px</span></span> in height. If your images result in blank spacing beneath the image, your image is too small to for a fullscreen Parallax. If the parallax isn&#8217;t very noticeable, that means the image isn&#8217;t large enough.</p>\n<p>To set a slider background as parallax, please open your hero widget and open a frame you would like to apply a parallax too. Open the Background settings group and set <span class=\"adminized-section\"><span class=\"adminized-part\">Background Type</span></span> to <span class=\"adminized-section\"><span class=\"adminized-part\">Parallax</span></span>. Repeat this process for the rest of the slides you wish to parallax.</p>\n<p>You can <a href=\"https://demo.siteorigin.com/premium/hero-addon/\">preview this functionality here</a>.</p>\n<h3>Hero Content Animations</h3>\n<p>To allow you to make really beautiful sliders that stand out, we recently released an update for the SiteOrigin Premium which adds transitional Content Animations for the SiteOrigin Hero widget. This functionality will allow you to add transitional effects for the text of your slider.</p>\n<p>To give your slide a context animation, please open your hero widget and open a frame you would like to apply a content animation too. Open the Content Animation settings group. You have access to all of the standard <a href=\"https://siteorigin.com/premium-documentation/plugin-addons/block-animations/\">Block Animation</a> options but the key difference is there&#8217;s a new Animation Event &#8211; Frame Display. This event is triggered every time the slide changes so the animation will continually animate.</p>\n<p>You can <a href=\"https://demo.siteorigin.com/premium/hero-addon/#parallax-sliders\">preview this functionality here</a>.</p>\n<h3>Responsive Notes</h3>\n<p>To ensure setup is as easy as possible, we use <span class=\"adminized-section\"><span class=\"adminized-part\">background-size: cover;</span></span> to allow for all images to fill the entire area of the hero widget. This prevents having to resize images manually. This functionality works by ensuring the image is always the same height of the area/slide its been applied to and to ensure this the browser can (and will) clip the sides of the image off. This can be problematic on mobile because if you use a height that&#8217;s too large, or add too much text it may result in parts of your image being hidden on mobile.</p>\n<p>To lower the impact of the slides being clipped off, you should use an image with a central focus, which is an image where the focus of the image is in the middle (or at least towards the middle). Alternatively, you could apply a <span class=\"adminized-section\"><span class=\"adminized-part\">Responsive Height</span></span> that works better for your image than the Height setting does. We&#8217;re unable to recommend a <span class=\"adminized-section\"><span class=\"adminized-part\">Responsive Height</span></span> as it depends solely on the image you&#8217;re using so you&#8217;ll need to try a number of different values to see what works for you and your image.</p>\n<p>Alternatively, give <a href=\"https://smartslider3.com/?source=siteorigin\">Smart Slider 3</a> a try as it handles slides in a different manner.</p>\n<p>If you have any questions or run into any issues, please feel free to leave a comment and we&#8217;ll lend a hand.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/create-fullscreen-slider-siteorigin-hero-widget/\">Create a Fullscreen Slider with the SiteOrigin Hero Widget</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"https://siteorigin.com/create-fullscreen-slider-siteorigin-hero-widget/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"10\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:42:\"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"GDPR and SiteOrigin Products\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"https://siteorigin.com/gdpr-and-siteorigin-products/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"https://siteorigin.com/gdpr-and-siteorigin-products/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 21 May 2018 12:32:01 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://siteorigin.com/?p=109960\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:580:\"<p>General Data Protection Regulation (GDPR) is European Union law on data protection and privacy for all individuals within the European Union. It addresses the export of personal data outside the EU. We\'ve assembled a brief guide on what sort of information you might need to add to your privacy policy to comply with GDPR when using SiteOrigin themes and plugins.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/gdpr-and-siteorigin-products/\">GDPR and SiteOrigin Products</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Alex S\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5829:\"<p>General Data Protection Regulation (GDPR) is European Union law on data protection and privacy for all individuals within the European Union. It addresses the export of personal data outside the EU. We&#8217;ve assembled a brief guide on what sort of information you might need to add to your privacy policy to comply with GDPR when using SiteOrigin themes and plugins.</p>\n<p><strong>Disclaimer:</strong> this post is by no means legal advice. If unsure, please seek professional consultation.</p>\n<h3>What is GDPR?</h3>\n<p>The General Data Protection Regulation (GDPR) is a legal framework that sets guidelines for the collection and processing of personal information of individuals within the European Union (EU).</p>\n<p>Read the full definition on <a href=\"https://en.wikipedia.org/wiki/General_Data_Protection_Regulation\">Wikipedia</a>.</p>\n<h3>Does GDPR Affect Me and My Website?</h3>\n<p>If your company is based in the European Union (EU), or you do business with EU citizens, the GDPR does affect you and your website so you need to comply. With that said, it would be a good idea comply with the regulations regardless, as it&#8217;s possible countries outside of the EU will implement similar legislation in the future.</p>\n<p><span id=\"more-109960\"></span></p>\n<h4>SiteOrigin CSS Plugin and SiteOrigin Themes</h4>\n<p>Good News! SiteOrigin CSS and SiteOrigin themes comply with the GDPR as none of them collect, store or transmit any user information. However, if you&#8217;re making use of Google Fonts in SiteOrigin CSS or SiteOrigin themes, you&#8217;ll need to make a note of this in your privacy policy. Google is GDPR compliant, <a href=\"https://privacy.google.com/businesses/compliance/\">find out more</a>.</p>\n<p>(Google Fonts can only be added from within SiteOrigin CSS using the Web Font Selector in SiteOrigin Premium.)</p>\n<h4>SiteOrigin Page Builder: Layouts Directory</h4>\n<p>The only GDPR concern in SiteOrigin Page Builder is the Layouts Directory. By default, all images in prebuilt layouts are hosted on layouts.siteorigin.com. We recommend changing these images as soon as possible. If you decide not to, you&#8217;ll need to make mention of these images in your privacy policy.</p>\n<h4>SiteOrigin Widgets Bundle</h4>\n<p>Certain widgets include Google Fonts if you decide to use any of those fonts you&#8217;ll need to mention that in your privacy policy. Google is GDPR compliant, <a href=\"https://privacy.google.com/businesses/compliance/\">find out more</a>.</p>\n<h4>SiteOrigin Contact Form Widget</h4>\n<p>While the SiteOrigin Contact Form widget doesn&#8217;t store data, it does handle user submitted data. As such, it&#8217;s a good idea to ask for consent before transmitting this data.</p>\n<p>To ask for consent, add a checkbox to your contact form and use the following values:</p>\n<p><strong>Field Type:</strong> Checkboxes<br />\n<strong>Required Field:</strong> Required (This field must be required)<br />\n<strong>Add an Option and set the Value to:</strong><br />\nPlease tick to consent to your data being stored temporarily, as per our privacy policy.</p>\n<p><img class=\"alignnone size-full wp-image-109968\" src=\"https://siteorigin.com/wp-content/uploads/2018/05/siteorigin-contact-form-GDPR-setup.png\" alt=\"\" width=\"1604\" height=\"1024\" srcset=\"https://siteorigin.com/wp-content/uploads/2018/05/siteorigin-contact-form-GDPR-setup.png 1604w, https://siteorigin.com/wp-content/uploads/2018/05/siteorigin-contact-form-GDPR-setup-300x192.png 300w, https://siteorigin.com/wp-content/uploads/2018/05/siteorigin-contact-form-GDPR-setup-768x490.png 768w, https://siteorigin.com/wp-content/uploads/2018/05/siteorigin-contact-form-GDPR-setup-699x446.png 699w, https://siteorigin.com/wp-content/uploads/2018/05/siteorigin-contact-form-GDPR-setup-1050x670.png 1050w, https://siteorigin.com/wp-content/uploads/2018/05/siteorigin-contact-form-GDPR-setup-313x200.png 313w, https://siteorigin.com/wp-content/uploads/2018/05/siteorigin-contact-form-GDPR-setup-600x383.png 600w, https://siteorigin.com/wp-content/uploads/2018/05/siteorigin-contact-form-GDPR-setup-1200x766.png 1200w\" sizes=\"(max-width: 1604px) 100vw, 1604px\" /></p>\n<p>If you choose to <strong>Log IP Address</strong>, you&#8217;ll need to mention this in your privacy policy. Logging the user&#8217;s IP Address simply includes the IP in the email, you&#8217;ll need to mention that it&#8217;s included, but not stored anywhere.</p>\n<p>If you&#8217;re using SiteOrigin Premium, the Contact From plugin addon allows you to add autoresponder functionality to email the user on form submission. If you use this functionality you&#8217;ll need to mention this in your privacy policy alongside your contact form information.</p>\n<h4>SiteOrigin Google Maps Widget</h4>\n<p>If you use the SiteOrigin Google Maps widget, you&#8217;ll need to mention that you use Google Maps in your privacy policy and that while you don&#8217;t personally collect this data, Google may. Google is GDPR compliant, <a href=\"https://privacy.google.com/businesses/compliance/\">find out more</a>.</p>\n<h4>SiteOrigin Video Player</h4>\n<p>If you embed any external video, such as from YouTube or Vimeo, you&#8217;ll need to mention this in your privacy policy. Be sure to check if the video you&#8217;re embedding is hosted on a service that is GDPR compliant.</p>\n<h3>Summary</h3>\n<p>Hopefully, this gives you a better idea of what GDPR is and how SiteOrigin themes and plugins might influence the creation of your website&#8217;s data management and privacy policy.</p>\n<p>If you have any questions or concerns, please feel free to leave a comment.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/gdpr-and-siteorigin-products/\">GDPR and SiteOrigin Products</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://siteorigin.com/gdpr-and-siteorigin-products/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"48\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"Gutenberg Compatibility in SiteOrigin Page Builder\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"https://siteorigin.com/gutenberg-compatibility-page-builder/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"https://siteorigin.com/gutenberg-compatibility-page-builder/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 22 Feb 2018 08:14:02 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:7:\"Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"http://siteorigin.com/?p=93803\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:608:\"<p>Gutenberg has made massive strides in 2018. It continues to evolve into what we hope will be a worthy core editor later this year with the release of WordPress 5.0. We’re doing our bit for the Gutenberg future of WordPress by adding compatibility to all our products. This will be available as a free update before Gutenberg is merged into the WordPress core.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/gutenberg-compatibility-page-builder/\">Gutenberg Compatibility in SiteOrigin Page Builder</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Greg Priday\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3713:\"<p><iframe width=\"840\" height=\"473\" src=\"https://www.youtube.com/embed/UC05MXR6LMg?feature=oembed&#038;vq=hd1080\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe></p>\n<p><a href=\"https://wordpress.org/plugins/gutenberg/\">Gutenberg</a> has made massive strides in 2018. It continues to evolve into what we hope will be a worthy core editor later this year with the release of <a href=\"https://make.wordpress.org/core/5-0/\">WordPress 5.0</a>.</p>\n<p>We&#8217;re doing our bit for the Gutenberg future of WordPress by adding compatibility to all our products. This will be available as a free update before Gutenberg is merged into the WordPress core.</p>\n<p>Just like we made our Widgets Bundle widgets available to <a href=\"https://siteorigin.com/widgets-beaver-builder-elementor/\">other page builder plugins</a>, we&#8217;re making all our widgets Gutenberg compatible. So you can add our buttons, tabbed layout, maps, etc. to your Gutenberg pages.</p>\n<p><span id=\"more-93803\"></span></p>\n<p>The thing we&#8217;re most excited about though, is that we&#8217;re making our Layout widget available as a Gutenberg block. The SiteOrigin Layout block gives you the full power of SiteOrigin Page Builder, so you&#8217;ll be able to create fully nested, columnized, widgetized content, with advanced row, column and widget styling right inside Gutenberg.</p>\n<p>Why are we doing this? Gutenberg is taking a more conservative approach to page building, which means there are designs and layouts that you just won&#8217;t be able to achieve. The SiteOrigin Layout block fills all those gaps, by allowing you to create advanced sections inside your Gutenberg pages.</p>\n<p>This is just the beginning, we&#8217;re planning on adding a lot more features by the time Gutenberg becomes the core WordPress editor. For example, we&#8217;ll give you a migration tool that&#8217;ll let you convert your existing Page Builder pages into Gutenberg pages.</p>\n<p>We&#8217;re excited to bring Page Builder and Widgets Bundle plugins, with over 2 million combined installs, into the future of WordPress. It&#8217;s our way of guaranteeing that your content is safe, as WordPress evolves into a more modern content creation platform.</p>\n<h4>Editing Options for Existing Page Builder Content</h4>\n<p>Once WordPress 5.0 is released you can rest assured that your Page Builder content will be safe and editable. Existing Page Builder content will be editable in one of two ways. If you&#8217;d prefer not to switch over to Gutenberg you can install the <a href=\"https://wordpress.org/plugins/classic-editor/\">Classic Editor</a> plugin provided by WordPress. Once activated, your existing Page Builder pages will remain exactly as they were pre WordPress 5.0. Alternatively, if you&#8217;d like to move over to Gutenberg, existing Page Builder pages will offer the option to migrate Page Builder content into a single Layout Builder block.</p>\n<h4>Editing Options for New Pages</h4>\n<p>If you have the Classic Editor plugin installed and add a new page, you&#8217;ll be able to choose between a classic page with the familiar Visual, Text and Page Builder tabs or a Gutenberg page. If you don&#8217;t have the Classic Editor plugin installed, your new pages will be Gutenberg pages.</p>\n<p>Once Gutenberg is integrated into the WordPress core there will be much more certainty. The above update and roadmap is based on the information that&#8217;s currently available.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/gutenberg-compatibility-page-builder/\">Gutenberg Compatibility in SiteOrigin Page Builder</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://siteorigin.com/gutenberg-compatibility-page-builder/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"86\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Introducing Corp Business Theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://siteorigin.com/introducing-corp-business-theme/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://siteorigin.com/introducing-corp-business-theme/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 20 Dec 2017 19:30:44 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:6:\"Themes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"http://siteorigin.com/?p=81713\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:570:\"<p>A little earlier this year we released Corp, our new business focused theme. Corp features a professional design, beautiful transitions and is a perfect platform for Page Builder by SiteOrigin or the page builder plugin of your choice. Corp is lightweight, responsive and fast loading. It’s perfectly suited to promoting businesses of all types.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/introducing-corp-business-theme/\">Introducing Corp Business Theme</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3336:\"<p>A little earlier this year we released <a href=\"https://wordpress.org/themes/siteorigin-corp/\">Corp</a>, our new business focused theme. Corp features a professional design, beautiful transitions and is a perfect platform for Page Builder by SiteOrigin or the page builder plugin of your choice. Corp is lightweight, responsive and fast loading. It&#8217;s perfectly suited to promoting businesses of all types. If you&#8217;re a developer, we&#8217;re sure you&#8217;ll find Corp a great theme to extend. <a href=\"http://demo.siteorigin.com/corp/\">View the theme demo</a>.</p>\n<p><span id=\"more-81713\"></span></p>\n<h3>Notable Features</h3>\n<ul>\n<li>Color Settings: Take full control over all theme background, element and font colors.</li>\n<li>Font Settings: Take full control over all theme fonts.</li>\n<li>Spacing Settings: Set header and footer padding and margins.</li>\n<li>Sticky Header: Sticks the header to the top of the screen when scrolling.</li>\n<li>Responsive Layout: Adapt the theme layout for mobile devices.</li>\n<li>Mobile Menu: Use a special responsive menu for small screen devices.</li>\n<li>Scroll to Top: Display a scroll to top button after scrolling.</li>\n<li>Sidebar Customizations: Set the sidebar position and width.</li>\n<li>Header Overlap: Overlap the header as we&#8217;ve done on the Corp demo home page: http://demo.siteorigin.com/corp/. Perfect for home or landing pages.</li>\n<li>Page Settings: Adjust the theme layout on each page or post as required. Included is a full-width option for Page Builder&#8217;s that require one.</li>\n<li>Page Template Settings: Take control of your blog and archive page layouts.</li>\n<li>Sidebar Width: Set the sidebar width as a percentage.</li>\n<li>Sidebar Position: Set the sidebar position to right or left.</li>\n</ul>\n<h3>Still to Come</h3>\n<p>In the next two months you can expect the following awesome new features:</p>\n<ul>\n<li>Complete WooCommerce support with custom styling.</li>\n<li>Four new blog layouts that&#8217;ll greatly enhance Corp&#8217;s customizability.</li>\n<li>Jetpack Portfolio support.</li>\n</ul>\n<h3>Something for our Premium Users</h3>\n<p>As with all of our themes, <a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> users will be able to remove the footer attribution, enable Ajax comments and get quick support via email.</p>\n<h3>Download Corp</h3>\n<p>Corp is available for download right now on the <a href=\"https://wordpress.org/themes/siteorigin-corp/\">WordPress.org theme directory</a>. Or from within your WordPress installation, <span class=\"adminized-section\"><span class=\"adminized-part\">Themes</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">Add New</span></span>, use the search field and search for &#8220;SiteOrigin Corp&#8221;. If you&#8217;d like a helping hand or would just like to preview Corp&#8217;s settings and features, check out the <a href=\"https://siteorigin.com/corp-documentation/\">documentation</a>.</p>\n<p>If you have any feedback or suggestions, we&#8217;d love to hear from you. Feel free to post below in the comments.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/introducing-corp-business-theme/\">Introducing Corp Business Theme</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"https://siteorigin.com/introducing-corp-business-theme/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"32\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:45:\"\n		\n		\n		\n		\n		\n				\n		\n\n		\n		\n				\n			\n		\n		\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"Introducing the Tabs Widget\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"https://siteorigin.com/introducing-tabs-widget/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://siteorigin.com/introducing-tabs-widget/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 23 Nov 2017 10:56:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Announcements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:7:\"Plugins\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"http://siteorigin.com/?p=76959\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:554:\"<p>Following our recent release of the Accordion widget, we&#8217;re really pleased to announce our new Tabs widget. Tabs offer a great way to organise and structure content in a small amount of space. Perfect for listing your services, products, page sections or any other content that has a horizontal structure to it. The Tabs widget [&#8230;]</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/introducing-tabs-widget/\">Introducing the Tabs Widget</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:6268:\"<p>Following our recent <a href=\"https://siteorigin.com/introducing-accordion-widget/\">release of the Accordion widget</a>, we&#8217;re really pleased to announce our new Tabs widget. Tabs offer a great way to organise and structure content in a small amount of space. Perfect for listing your services, products, page sections or any other content that has a horizontal structure to it.</p>\n<p>The Tabs widget is included in the <a href=\"https://siteorigin.com/widgets-bundle/\">Widgets Bundle</a> plugin release version 1.11.0. SiteOrigin Widgets can be inserted into any page using <a href=\"https://siteorigin.com/page-builder/\">SiteOrigin Page Builder</a> or any of the <a href=\"https://siteorigin.com/widgets-beaver-builder-elementor/\">other Page Builders that we support</a>. You can also insert widgets into theme widget areas.</p>\n<p><span id=\"more-76959\"></span></p>\n<p>As always, this is a completely free addon. All you need to do is update your copy of Widgets Bundle, then navigate to <span class=\"adminized-section\"><span class=\"adminized-part\">Plugins</span><span class=\"adminized-arrow icon-arrow-right\"></span><span class=\"adminized-part\">SiteOrigin Widgets</span></span> in your WordPress admin, search for and activate the Tabs widget.</p>\n<p>If you need a hand getting started, please, see the <a href=\"https://siteorigin.com/widgets-bundle/tabs-widget/\">Tabs widget documentation</a>.</p>\n<h3>Extra Options for SiteOrigin Premium Users</h3>\n<p><a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> adds awesome functionality and additional features across our range of plugins and themes. The Tabs addon in SiteOrigin Premium adds a host of extra settings and features. The two you might find most useful are:</p>\n<h4>Preset Designs</h4>\n<p>To make the most of the extra settings and save you time, the Presets setting lets you choose from four unique designs. All the designs use neutral colours making it easy to adapt to your website colour scheme.</p>\n<div id=\"attachment_77202\" style=\"width: 709px\" class=\"wp-caption aligncenter\"><img class=\"wp-image-77202 size-large\" src=\"https://siteorigin.com/wp-content/uploads/2017/11/01-699x164.jpg\" alt=\"\" width=\"699\" height=\"164\" srcset=\"https://siteorigin.com/wp-content/uploads/2017/11/01-699x164.jpg 699w, https://siteorigin.com/wp-content/uploads/2017/11/01-300x70.jpg 300w, https://siteorigin.com/wp-content/uploads/2017/11/01-768x180.jpg 768w, https://siteorigin.com/wp-content/uploads/2017/11/01-1050x247.jpg 1050w, https://siteorigin.com/wp-content/uploads/2017/11/01-313x74.jpg 313w, https://siteorigin.com/wp-content/uploads/2017/11/01-600x141.jpg 600w, https://siteorigin.com/wp-content/uploads/2017/11/01-1200x282.jpg 1200w\" sizes=\"(max-width: 699px) 100vw, 699px\" /></p>\n<p class=\"wp-caption-text\">Flat Preset Design</p>\n</div>\n<div id=\"attachment_77203\" style=\"width: 709px\" class=\"wp-caption aligncenter\"><img class=\"wp-image-77203 size-large\" src=\"https://siteorigin.com/wp-content/uploads/2017/11/02-699x190.jpg\" alt=\"\" width=\"699\" height=\"190\" srcset=\"https://siteorigin.com/wp-content/uploads/2017/11/02-699x190.jpg 699w, https://siteorigin.com/wp-content/uploads/2017/11/02-300x82.jpg 300w, https://siteorigin.com/wp-content/uploads/2017/11/02-768x209.jpg 768w, https://siteorigin.com/wp-content/uploads/2017/11/02-1050x286.jpg 1050w, https://siteorigin.com/wp-content/uploads/2017/11/02-313x85.jpg 313w, https://siteorigin.com/wp-content/uploads/2017/11/02-600x163.jpg 600w, https://siteorigin.com/wp-content/uploads/2017/11/02-1200x326.jpg 1200w\" sizes=\"(max-width: 699px) 100vw, 699px\" /></p>\n<p class=\"wp-caption-text\">Wire Preset Design</p>\n</div>\n<div id=\"attachment_77204\" style=\"width: 709px\" class=\"wp-caption aligncenter\"><img class=\"wp-image-77204 size-large\" src=\"https://siteorigin.com/wp-content/uploads/2017/11/03-699x185.jpg\" alt=\"\" width=\"699\" height=\"185\" srcset=\"https://siteorigin.com/wp-content/uploads/2017/11/03-699x185.jpg 699w, https://siteorigin.com/wp-content/uploads/2017/11/03-300x79.jpg 300w, https://siteorigin.com/wp-content/uploads/2017/11/03-768x203.jpg 768w, https://siteorigin.com/wp-content/uploads/2017/11/03-1050x278.jpg 1050w, https://siteorigin.com/wp-content/uploads/2017/11/03-313x83.jpg 313w, https://siteorigin.com/wp-content/uploads/2017/11/03-600x159.jpg 600w, https://siteorigin.com/wp-content/uploads/2017/11/03-1200x317.jpg 1200w\" sizes=\"(max-width: 699px) 100vw, 699px\" /></p>\n<p class=\"wp-caption-text\">Rounded 01 Preset Design</p>\n</div>\n<div id=\"attachment_77205\" style=\"width: 709px\" class=\"wp-caption aligncenter\"><img class=\"wp-image-77205 size-large\" src=\"https://siteorigin.com/wp-content/uploads/2017/11/04-699x177.jpg\" alt=\"\" width=\"699\" height=\"177\" srcset=\"https://siteorigin.com/wp-content/uploads/2017/11/04-699x177.jpg 699w, https://siteorigin.com/wp-content/uploads/2017/11/04-300x76.jpg 300w, https://siteorigin.com/wp-content/uploads/2017/11/04-768x195.jpg 768w, https://siteorigin.com/wp-content/uploads/2017/11/04-1050x266.jpg 1050w, https://siteorigin.com/wp-content/uploads/2017/11/04-313x79.jpg 313w, https://siteorigin.com/wp-content/uploads/2017/11/04-600x152.jpg 600w, https://siteorigin.com/wp-content/uploads/2017/11/04-1200x304.jpg 1200w\" sizes=\"(max-width: 699px) 100vw, 699px\" /></p>\n<p class=\"wp-caption-text\">Rounded 02 Preset Design</p>\n</div>\n<p>View a demo of the <a href=\"http://demo.siteorigin.com/premium/tabs-addon/\">preset tab designs</a>.</p>\n<h4>Layout Builder</h4>\n<p>The free Tab widget lets you add standard TinyMCE text content, but in the premium addon, we’re giving you the power to create tab content using a layout field. This means you can fill your tabs with complex widgets and Page Builder style layouts (rows and columns).</p>\n<p>If you aren’t a <a href=\"https://siteorigin.com/downloads/premium/\">SiteOrigin Premium</a> member yet, be sure to sign up. It’s a cost-effective way to build your sites faster and more professionally. We’re introducing more addons all the time, so the longer you’re a member, the more valuable it becomes.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/introducing-tabs-widget/\">Introducing the Tabs Widget</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"https://siteorigin.com/introducing-tabs-widget/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"