\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"http://siteorigin.com/?p=72866\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:557:\"<p>We&#8217;re really pleased to announce Unwind now offers support for Jetpack Portfolio custom post type. If you have a portfolio of any sort that you&#8217;d like to show off, Jetpack Portfolio is a great way to do it. View our photography portfolio demo. In this case we&#8217;ve built a small portfolio of travel photos. You [&#8230;]</p>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/new-portfolio-support-unwind/\">New Portfolio Support for Unwind</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Andrew Misplon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:898:\"<p>We&#8217;re really pleased to announce Unwind now offers support for Jetpack Portfolio custom post type. If you have a portfolio of any sort that you&#8217;d like to show off, Jetpack Portfolio is a great way to do it. View our <a href=\"http://demo.siteorigin.com/unwind/photography-portfolio/\">photography portfolio demo</a>. In this case we&#8217;ve built a small portfolio of travel photos. You can use this great feature for showing off a portfolio of any kind of work.</p>\n<p>For instructions on activating Jetpack, adding portfolio items and displaying your portfolio, <a href=\"https://siteorigin.com/unwind-documentation/portfolio/\">view the documentation</a>.</p>\n<h3></h3>\n<p>The post <a rel=\"nofollow\" href=\"https://siteorigin.com/new-portfolio-support-unwind/\">New Portfolio Support for Unwind</a> appeared first on <a rel=\"nofollow\" href=\"https://siteorigin.com\">SiteOrigin</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"https://siteorigin.com/new-portfolio-support-unwind/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:28:\"https://siteorigin.com/feed/\";s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:44:\"http://purl.org/rss/1.0/modules/syndication/\";a:2:{s:12:\"updatePeriod\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"hourly\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:15:\"updateFrequency\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"1\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:16:{s:4:\"date\";s:29:\"Sat, 06 Oct 2018 12:15:25 GMT\";s:12:\"content-type\";s:34:\"application/rss+xml; charset=UTF-8\";s:10:\"set-cookie\";s:131:\"__cfduid=d12522f9eef04c864cea25b45ce0cde351538828125; expires=Sun, 06-Oct-19 12:15:25 GMT; path=/; domain=.siteorigin.com; HttpOnly\";s:13:\"cache-control\";s:22:\"publi