(337, 87, '_form', '[md-form]\n\n[md-raw]\nVous avez la possibilité de demander un devis gratuit afin d\'établir un premier contact avec l\'équipe O-rizon.\n[/md-raw]\n\n[md-text label=\"Nom\"]\n[text* v-surname]\n[/md-text]\n\n[md-text label=\"Prénom\"]\n[text* v-name]\n[/md-text]\n\n[md-text label=\"Nom de l\'établissement\"]\n[text* v-school]\n[/md-text]\n\n[md-text label=\"Email\"]\n[email* v-email]\n[/md-text]\n\n[md-text label=\"Numéro de téléphone\"]\n[tel* v-tel]\n[/md-text]\n\n[md-select label=\"Taille de l\'établissement\"]\n[select* v-size \"Moins de 300 élèves\" \"Entre 300 et 800 élèves\" \"Plus de 800 élèves\"]\n[/md-select]\n\n[md-select label=\"Offre préférée\"]\n[select* v-type \"ENT\" \"ENT+\" \"ENTVS\"]\n[/md-select]\n\n[md-textarea label=\"Message\"]\n[textarea v-message]\n[/md-textarea]\n\n[md-submit]\n[submit \"Demander un devis\"]\n[/md-submit]\n\n[/md-form]'),
(338, 87, '_mail', 'a:9:{s:6:\"active\";b:1;s:7:\"subject\";s:26:\"O-rizon \"Demande de devis\"\";s:6:\"sender\";s:43:\"[v-name] [v-surname] <orizon.dev@gmail.com>\";s:9:\"recipient\";s:20:\"orizon.dev@gmail.com\";s:4:\"body\";s:322:\"De : [v-name] [v-surname] <[your-email]>\nObjet : Demande de devis\n\nNuméro de téléphone : [v-tel]\nNom de l\'établissement : [v-school]\nTaille de l\'établissement : [v-size]\nOffre préférée : [v-type]\nMessage : [v-message]\n\n-- \nCet e-mail a été envoyé via le formulaire de demande de devis du site vitrine O-rizon.\";s:18:\"additional_headers\";s:18:\"Reply-To:[v-email]\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:0;s:13:\"exclude_blank\";b:0;}'),
(339, 87, '_mail_2', 'a:9:{s:6:\"active\";b:0;s:7:\"subject\";s:24:\"O-rizon \"[your-subject]\"\";s:6:\"sender\";s:30:\"O-rizon <orizon.dev@gmail.com>\";s:9:\"recipient\";s:12:\"[your-email]\";s:4:\"body\";s:132:\"Corps du message :\n[your-message]\n\n-- \nCet e-mail a été envoyé via le formulaire de contact de O-rizon (http://o-rizon.eu)\";s:18:\"additional_headers\";s:30:\"Reply-To: orizon.dev@gmail.com\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:0;s:13:\"exclude_blank\";b:0;}'),
