(87, 1, '2018-06-29 11:57:20', '2018-06-29 09:57:20', '[md-form]\r\n\r\n[md-raw]\r\nVous avez la possibilité de demander un devis gratuit afin d\'établir un premier contact avec l\'équipe O-rizon.\r\n[/md-raw]\r\n\r\n[md-text label=\"Nom\"]\r\n[text* v-surname]\r\n[/md-text]\r\n\r\n[md-text label=\"Prénom\"]\r\n[text* v-name]\r\n[/md-text]\r\n\r\n[md-text label=\"Nom de l\'établissement\"]\r\n[text* v-school]\r\n[/md-text]\r\n\r\n[md-text label=\"Email\"]\r\n[email* v-email]\r\n[/md-text]\r\n\r\n[md-text label=\"Numéro de téléphone\"]\r\n[tel* v-tel]\r\n[/md-text]\r\n\r\n[md-select label=\"Taille de l\'établissement\"]\r\n[select* v-size \"Moins de 300 élèves\" \"Entre 300 et 800 élèves\" \"Plus de 800 élèves\"]\r\n[/md-select]\r\n\r\n[md-select label=\"Offre préférée\"]\r\n[select* v-type \"ENT\" \"ENT+\" \"ENTVS\"]\r\n[/md-select]\r\n\r\n[md-textarea label=\"Message\"]\r\n[textarea v-message]\r\n[/md-textarea]\r\n\r\n[md-submit]\r\n[submit \"Demander un devis\"]\r\n[/md-submit]\r\n\r\n[/md-form]\n1\nO-rizon \"Demande de devis\"\n[v-name] [v-surname] <orizon.dev@gmail.com>\norizon.dev@gmail.com\nDe : [v-name] [v-surname] <[your-email]>\r\nObjet : Demande de devis\r\n\r\nNuméro de téléphone : [v-tel]\r\nNom de l\'établissement : [v-school]\r\nTaille de l\'établissement : [v-size]\r\nOffre préférée : [v-type]\r\nMessage : [v-message]\r\n\r\n-- \r\nCet e-mail a été envoyé via le formulaire de demande de devis du site vitrine O-rizon.\nReply-To:[v-email]\n\n\n\n\nO-rizon \"[your-subject]\"\nO-rizon <orizon.dev@gmail.com>\n[your-email]\nCorps du message :\r\n[your-message]\r\n\r\n-- \r\nCet e-mail a été envoyé via le formulaire de contact de O-rizon (http://o-rizon.eu)\nReply-To: orizon.dev@gmail.com\n\n\n\nMerci pour votre message. Il a été envoyé.\nUne erreur s’est produite lors de l’envoi de votre message. Veuillez essayer à nouveau plus tard.\nUn ou plusieurs champs contiennent une erreur. Veuillez vérifier et essayer à nouveau.\nUne erreur s’est produite lors de l’envoi de votre message. Veuillez essayer à nouveau plus tard.\nVous devez accepter les termes et conditions avant d’envoyer votre message.\nCe champ est obligatoire.\nLe champ est trop long.\nLe champ est trop court.\nLe format de date est incorrect.\nLa date précède la première date autorisée.\nLa date est postérieure à la dernière date autorisée.\nUne erreur inconnue s’est produite lors du téléversement du fichier.\nVous n’avez pas les droits nécessaires pour téléverser ce type de fichier.\nLe fichier est trop volumineux.\nUne erreur s’est produite lors du téléversement du fichier.\nLe format du nombre est invalide.\nLe nombre est plus petit que le minimum autorisé.\nLe nombre est plus grand que le maximum autorisé.\nLa réponse à la question est incorrecte.\nLe code entré est incorrect.\nL’adresse e-mail n’est pas valide.\nL’URL n’est pas valide.\nLe numéro de téléphone n’est pas valide.', 'Demande de devis', '', 'publish', 'closed', 'closed', '', 'formulaire-de-contact-1', '', '', '2018-06-29 18:15:44', '2018-06-29 16:15:44', '', 0, 'http://o-rizon.eu/?post_type=wpcf7_contact_form&#038;p=87', 0, 'wpcf7_contact_form', '', 0),
(89, 1, '2018-06-29 13:04:39', '2018-06-29 11:04:39', '<div id=\"pl-20\"  class=\"panel-layout\" ><div id=\"pg-20-0\"  class=\"panel-grid panel-no-style\" ><div id=\"pgc-20-0-0\"  class=\"panel-grid-cell\"  data-weight=\"1\" ><div id=\"panel-20-0-0-0\" class=\"so-panel widget widget_sow-editor panel-first-child panel-last-child\" data-index=\"0\" ><div class=\"so-widget-sow-editor so-widget-sow-editor-base\">\n<div class=\"siteorigin-widget-tinymce textwidget\">\n	C’est une page avec des informations de contact de base, comme l’adresse et le numéro de téléphone. Vous pouvez aussi essayer une extension pour ajouter un formulaire de contact.</div>\n</div></div></div></div></div>', 'Tarifs', '', 'inherit', 'closed', 'closed', '', '20-autosave-v1', '', '', '2018-06-29 13:04:39', '2018-06-29 11:04:39', '', 20, 'http://o-rizon.eu/2018/06/29/20-autosave-v1/', 0, 'revision', '', 0),
(201, 1, '2018-07-08 09:59:07', '2018-07-08 07:59:07', '<div class=\"container-fluid\">\n<div class=\"row\">\n<h2>Un espace numérique de travail complet</h2>\n<div class=\"col-xs-12 col-sm-6\" style=\"text-align:justify;\">\nO-rizon Étudiant est avant tout un bel espace numérique de travail (ENT) intuitif et ergonomique permettant à l\'étudiant de travailler dans de bonnes conditions afin d\'atteindre plusieurs buts. Ce nouvel ENT permet à l\'étudiant d\'avoir accès à des fonctionnalités élémentaires lui permettant d\'accroître sa gestion et son organisation scolaire, qu\'il soit collégien ou lycéen. Il peut ainsi gérer son planning et ses devoirs, ses emails, son relevé de notes, son espace de stockage en ligne et voir les cours donnés par ses professeurs grâce à une interface simple d\'utilisation et intuitive.\n</div>\n<div class=\"col-xs-offset-2 col-xs-8 col-sm-offset-0 col-sm-6\" style=\"padding-top:20px;\">\n<img style=\"width:100%;height:auto;\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/student-849825_640-300x200.jpg\" />\n</div>\n</div>\n</div>\n\n<div class=\"container-fluid\" style=\"margin-top:50px;\">\n<div class=\"row\">\n<h2>Un outil de suivi d\'orientation révolutionnaire</h2>\n<div class=\"col-xs-offset-2 col-xs-8 col-sm-offset-0 col-sm-6\" style=\"padding-bottom:20px;\">\n<img style=\"width:100%;height:auto\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/magnetic-compass-390912_640-300x200.jpg\" />\n</div>\n<div class=\"col-xs-12 col-sm-6\" style=\"text-align:justify;\">\nO-rizon Étudiant est également un outil d\'orientation performant qui utilise les dernières avancées technologiques en matière d\'intelligence artificielle afin d\'effectuer un suivi à long terme et des propositions d\'orientation basées sur les intérêts et les notes de l\'élève. Cet outil permet à l\'élève de combler ses doutes et craintes en matière d\'orientation professionnelle au plus tôt tout en gardant un suivi d\'un réel conseiller d\'orientation. La plateforme contient également toute une base de données liées aux différents métiers existants ainsi que les formations permettant d\'atteindre ces métiers.\n</div>\n</div>\n</div>', 'Étudiant', '', 'inherit', 'closed', 'closed', '', '66-autosave-v1', '', '', '2018-07-08 09:59:07', '2018-07-08 07:59:07', '', 66, 'http://o-rizon.eu/2018/07/08/66-autosave-v1/', 0, 'revision', '', 0),
(202, 1, '2018-07-08 09:18:09', '2018-07-08 07:18:09', '<h2>Un espace numérique de travail complet et moderne</h2>\r\nO-rizon Étudiant est avant tout un bel espace numérique de travail (ENT) intuitif et ergonomique permettant à l\'étudiant de travailler dans de bonnes conditions afin d\'atteindre plusieurs buts. Ce nouvel ENT permet à l\'étudiant d\'avoir accès à des fonctionnalités élémentaires lui permettant d\'accroître sa gestion et son organisation scolaire, qu\'il soit collégien ou lycéen. Il peut ainsi gérer son planning et ses devoirs, ses emails, son relevé de notes, son espace de stockage en ligne et voir les cours donnés par ses professeurs grâce à une interface simple d\'utilisation et intuitive.\r\n\r\nO-rizon Étudiant est également un outil d\'orientation performant qui utilise les dernières avancées technologiques en matière d\'intelligence artificielle afin d\'effectuer un suivi à long terme et des propositions d\'orientation basées sur les intérêts et les notes de l\'élève. Cet outil permet à l\'élève de combler ses doutes et craintes en matière d\'orientation professionnelle au plus tôt tout en gardant un suivi d\'un réel conseiller d\'orientation. La plateforme contient également toute une base de données liées aux différents métiers existants ainsi que les formations permettant d\'atteindre ces métiers.', 'Étudiant', '', 'inherit', 'closed', 'closed', '', '66-revision-v1', '', '', '2018-07-08 09:18:09', '2018-07-08 07:18:09', '', 66, 'http://o-rizon.eu/2018/07/08/66-revision-v1/', 0, 'revision', '', 0),
(203, 1, '2018-07-08 09:18:40', '2018-07-08 07:18:40', '<h2>Un espace numérique de travail complet et moderne</h2>\r\nO-rizon Étudiant est avant tout un bel espace numérique de travail (ENT) intuitif et ergonomique permettant à l\'étudiant de travailler dans de bonnes conditions afin d\'atteindre plusieurs buts. Ce nouvel ENT permet à l\'étudiant d\'avoir accès à des fonctionnalités élémentaires lui permettant d\'accroître sa gestion et son organisation scolaire, qu\'il soit collégien ou lycéen. Il peut ainsi gérer son planning et ses devoirs, ses emails, son relevé de notes, son espace de stockage en ligne et voir les cours donnés par ses professeurs grâce à une interface simple d\'utilisation et intuitive.\r\n<h2>Un outil de suivi d\'orientation révolutionnaire</h2>\r\nO-rizon Étudiant est également un outil d\'orientation performant qui utilise les dernières avancées technologiques en matière d\'intelligence artificielle afin d\'effectuer un suivi à long terme et des propositions d\'orientation basées sur les intérêts et les notes de l\'élève. Cet outil permet à l\'élève de combler ses doutes et craintes en matière d\'orientation professionnelle au plus tôt tout en gardant un suivi d\'un réel conseiller d\'orientation. La plateforme contient également toute une base de données liées aux différents métiers existants ainsi que les formations permettant d\'atteindre ces métiers.', 'Étudiant', '', 'inherit', 'closed', 'closed', '', '66-revision-v1', '', '', '2018-07-08 09:18:40', '2018-07-08 07:18:40', '', 66, 'http://o-rizon.eu/2018/07/08/66-revision-v1/', 0, 'revision', '', 0),
