(206, 1, '2018-07-08 09:30:47', '2018-07-08 07:30:47', '<img src=\"http://o-rizon.eu/wp-content/uploads/2018/07/student-849825_640-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" class=\"alignnone size-medium wp-image-205\" /> <img src=\"http://o-rizon.eu/wp-content/uploads/2018/07/magnetic-compass-390912_640-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" class=\"alignnone size-medium wp-image-204\" />\r\n<h2>Un espace numérique de travail complet et moderne</h2>\r\nO-rizon Étudiant est avant tout un bel espace numérique de travail (ENT) intuitif et ergonomique permettant à l\'étudiant de travailler dans de bonnes conditions afin d\'atteindre plusieurs buts. Ce nouvel ENT permet à l\'étudiant d\'avoir accès à des fonctionnalités élémentaires lui permettant d\'accroître sa gestion et son organisation scolaire, qu\'il soit collégien ou lycéen. Il peut ainsi gérer son planning et ses devoirs, ses emails, son relevé de notes, son espace de stockage en ligne et voir les cours donnés par ses professeurs grâce à une interface simple d\'utilisation et intuitive.\r\n<h2>Un outil de suivi d\'orientation révolutionnaire</h2>\r\nO-rizon Étudiant est également un outil d\'orientation performant qui utilise les dernières avancées technologiques en matière d\'intelligence artificielle afin d\'effectuer un suivi à long terme et des propositions d\'orientation basées sur les intérêts et les notes de l\'élève. Cet outil permet à l\'élève de combler ses doutes et craintes en matière d\'orientation professionnelle au plus tôt tout en gardant un suivi d\'un réel conseiller d\'orientation. La plateforme contient également toute une base de données liées aux différents métiers existants ainsi que les formations permettant d\'atteindre ces métiers.', 'Étudiant', '', 'inherit', 'closed', 'closed', '', '66-revision-v1', '', '', '2018-07-08 09:30:47', '2018-07-08 07:30:47', '', 66, 'http://o-rizon.eu/2018/07/08/66-revision-v1/', 0, 'revision', '', 0),
