(255, 1, '2018-08-07 18:19:36', '2018-08-07 16:19:36', '<div class=\"container-fluid\">\r\n<div class=\"row\">\r\n<h2 style=\"text-align:center;\">Une aide concrète pour les conseillers</h2>\r\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\r\n<img style=\"width:100%;height:auto;\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/business-3560929_640.jpg\" />\r\n</div>\r\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\r\n<p>\r\nO-rizon C offre une technologie nouvelle pour suivre les progrès des élèves ainsi que leurs intérêts personnels grâce à l\'intelligence  artificielle d\'O-rizon.\r\n<br />\r\nLe travail des conseillers d\'orientation est aidé grâce à des fonctionnalités de suivi complètes et des indicateurs graphiques précis.\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n', 'Conseiller d\'orientation', '', 'inherit', 'closed', 'closed', '', '72-revision-v1', '', '', '2018-08-07 18:19:36', '2018-08-07 16:19:36', '', 72, 'http://o-rizon.eu/2018/08/07/72-revision-v1/', 0, 'revision', '', 0),
(245, 1, '2018-07-29 18:30:17', '2018-07-29 16:30:17', '<div class=\"container-fluid\">\r\n<div class=\"row\">\r\n<h2 style=\"text-align:center;\">Une aide concrète pour les conseillers</h2>\r\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\r\n<img style=\"width:100%;height:auto;\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/business-3560929_640.jpg\" />\r\n</div>\r\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\r\n<p>\r\nO-rizon Conseiller d\'Orientation offre une technologie nouvelle pour suivre les progrès des élèves ainsi que leurs intérêts personnels grâce à l\'intelligence  artificielle d\'O-rizon.\r\n<br />\r\nLe travail des conseillers d\'orientation est aidé grâce à des fonctionnalités de suivi complètes et des indicateurs graphiques précis.\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n', 'Conseiller d\'orientation', '', 'inherit', 'closed', 'closed', '', '72-revision-v1', '', '', '2018-07-29 18:30:17', '2018-07-29 16:30:17', '', 72, 'http://o-rizon.eu/2018/07/29/72-revision-v1/', 0, 'revision', '', 0),
(246, 1, '2018-07-29 18:37:54', '2018-07-29 16:37:54', '<div class=\"container-fluid\">\n<div class=\"row\">\n<h2 style=\"text-align:center;\">Les parents ont leur outil de suivi</h2>\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\n<img style=\"width:100%;height:auto;\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/business-3560929_640.jpg\" />\n</div>\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\n<p>\nO-rizon Parent donne aux parents d\'élèves des outils pour suivre la scolarité et la réussite globale de leurs enfants au moyen de fonctionnalités statistiques détaillées.\n<br />\nL\'application pour les parents utilisent également l\'intelligence artificielle d\'O-rizon et leur permet de suivre d\'un oeil aguérri\n</p>\n</div>\n</div>\n</div>\n', 'Parent', '', 'inherit', 'closed', 'closed', '', '74-autosave-v1', '', '', '2018-07-29 18:37:54', '2018-07-29 16:37:54', '', 74, 'http://o-rizon.eu/2018/07/29/74-autosave-v1/', 0, 'revision', '', 0),
