(210, 1, '2018-07-08 09:38:21', '2018-07-08 07:38:21', '<div class=\"row\">\r\n<h2>Un espace numérique de travail complet</h2>\r\n<div class=\"col-xs-12 col-sm-6\">\r\nO-rizon Étudiant est avant tout un bel espace numérique de travail (ENT) intuitif et ergonomique permettant à l\'étudiant de travailler dans de bonnes conditions afin d\'atteindre plusieurs buts. Ce nouvel ENT permet à l\'étudiant d\'avoir accès à des fonctionnalités élémentaires lui permettant d\'accroître sa gestion et son organisation scolaire, qu\'il soit collégien ou lycéen. Il peut ainsi gérer son planning et ses devoirs, ses emails, son relevé de notes, son espace de stockage en ligne et voir les cours donnés par ses professeurs grâce à une interface simple d\'utilisation et intuitive.\r\n</div>\r\n<div class=\"col-xs-12 col-sm-6\">\r\n<img src=\"http://o-rizon.eu/wp-content/uploads/2018/07/student-849825_640-300x200.jpg\" />\r\n</div>\r\n</div>\r\n\r\n<div class=\"row\">\r\n<h2>Un outil de suivi d\'orientation révolutionnaire</h2>\r\n<div class=\"col-xs-12 col-sm-6\">\r\n<img src=\"http://o-rizon.eu/wp-content/uploads/2018/07/magnetic-compass-390912_640-300x200.jpg\" />\r\n</div>\r\n<div class=\"col-xs-12 col-sm-6\">\r\nO-rizon Étudiant est également un outil d\'orientation performant qui utilise les dernières avancées technologiques en matière d\'intelligence artificielle afin d\'effectuer un suivi à long terme et des propositions d\'orientation basées sur les intérêts et les notes de l\'élève. Cet outil permet à l\'élève de combler ses doutes et craintes en matière d\'orientation professionnelle au plus tôt tout en gardant un suivi d\'un réel conseiller d\'orientation. La plateforme contient également toute une base de données liées aux différents métiers existants ainsi que les formations permettant d\'atteindre ces métiers.\r\n</div>\r\n</div>', 'Étudiant', '', 'inherit', 'closed', 'closed', '', '66-revision-v1', '', '', '2018-07-08 09:38:21', '2018-07-08 07:38:21', '', 66, 'http://o-rizon.eu/2018/07/08/66-revision-v1/', 0, 'revision', '', 0),
(76, 1, '2018-06-29 11:31:34', '2018-06-29 09:31:34', 'C’est une page avec des informations de contact de base, comme l’adresse et le numéro de téléphone. Vous pouvez aussi essayer une extension pour ajouter un formulaire de contact.', 'Tarifs', '', 'inherit', 'closed', 'closed', '', '20-revision-v1', '', '', '2018-06-29 11:31:34', '2018-06-29 09:31:34', '', 20, 'http://o-rizon.eu/2018/06/29/20-revision-v1/', 0, 'revision', '', 0),
(62, 1, '2018-06-29 11:25:43', '2018-06-29 09:25:43', 'C’est une page avec des informations de contact de base, comme l’adresse et le numéro de téléphone. Vous pouvez aussi essayer une extension pour ajouter un formulaire de contact.', 'Demande de devis', '', 'inherit', 'closed', 'closed', '', '20-revision-v1', '', '', '2018-06-29 11:25:43', '2018-06-29 09:25:43', '', 20, 'http://o-rizon.eu/2018/06/29/20-revision-v1/', 0, 'revision', '', 0),
(66, 1, '2018-06-29 11:28:14', '2018-06-29 09:28:14', '<div class=\"container-fluid\">\r\n<div class=\"row\">\r\n<h2 style=\"text-align:center;\">Un espace numérique de travail complet</h2>\r\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\r\n<img style=\"width:100%;height:auto;\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/student-849825_640-300x200.jpg\" />\r\n</div>\r\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\r\n<p>O-rizon S est avant tout un bel espace numérique de travail (ENT) intuitif et ergonomique permettant à l\'étudiant de travailler dans de bonnes conditions afin d\'atteindre plusieurs buts. Ce nouvel ENT permet à l\'étudiant d\'avoir accès à des fonctionnalités élémentaires lui permettant d\'accroître sa gestion et son organisation scolaire, qu\'il soit collégien ou lycéen. Il peut ainsi gérer son planning et ses devoirs, ses emails, son relevé de notes, son espace de stockage en ligne et voir les cours donnés par ses professeurs grâce à une interface simple d\'utilisation et intuitive.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<hr />\r\n\r\n<div class=\"container-fluid\" style=\"margin-top:50px;\">\r\n<div class=\"row\">\r\n<h2 style=\"text-align:center;\">Un outil de suivi d\'orientation révolutionnaire</h2>\r\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\r\n<img style=\"width:100%;height:auto\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/magnetic-compass-390912_640-300x200.jpg\" />\r\n</div>\r\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\r\n<p>O-rizon S est également un outil d\'orientation performant qui utilise les dernières avancées technologiques en matière d\'intelligence artificielle afin d\'effectuer un suivi à long terme et des propositions d\'orientation basées sur les intérêts et les notes de l\'élève. Cet outil permet à l\'élève de combler ses doutes et craintes en matière d\'orientation professionnelle au plus tôt tout en gardant un suivi d\'un réel conseiller d\'orientation. La plateforme contient également toute une base de données liées aux différents métiers existants ainsi que les formations permettant d\'atteindre ces métiers.</p>\r\n</div>\r\n</div>\r\n</div>', 'Étudiant', '', 'publish', 'closed', 'closed', '', 'etudiant', '', '', '2018-08-07 18:17:29', '2018-08-07 16:17:29', '', 0, 'http://o-rizon.eu/?page_id=66', 0, 'page', '', 0),
(67, 1, '2018-06-29 11:28:14', '2018-06-29 09:28:14', '', 'Étudiant', '', 'inherit', 'closed', 'closed', '', '66-revision-v1', '', '', '2018-06-29 11:28:14', '2018-06-29 09:28:14', '', 66, 'http://o-rizon.eu/2018/06/29/66-revision-v1/', 0, 'revision', '', 0),
(68, 1, '2018-06-29 11:29:26', '2018-06-29 09:29:26', '<div class=\"container-fluid\">\r\n<div class=\"row\">\r\n<h2 style=\"text-align:center;\">Une meilleure gestion de l\'établissement</h2>\r\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\r\n<img style=\"width:100%;height:auto;\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/achievement-3408115_640.jpg\" />\r\n</div>\r\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\r\n<p>\r\nO-rizon ASL a été conçu pour les collèges et lycées de France afin de leur permettre de pouvoir avoir une gestion de leur établissement améliorée et simplifiées grâce à des outils modernes et efficaces.\r\n<br />\r\nAvec O-rizon, les établissements vont en être en mesure de définir des années scolaires avec les périodes trimestrielles et de vacances adaptées mais également définir les matières enseignées au sein de l\'établissement et gérer tous les comptes liés.\r\n<br />\r\nAvec une ergonomie intuitive, la gestion du personnel et des élèves sera beaucoup plus facile qu\'auparavant. Les établissements peuvent créer des classes et y associer des professeurs ainsi que des élèves plus vite qu\'avec un autre logiciel.\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<hr />\r\n\r\n<div class=\"container-fluid\" style=\"margin-top:50px;\">\r\n<div class=\"row\">\r\n<h2 style=\"text-align:center;\">Une vie scolaire intégralement numérique</h2>\r\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\r\n<img style=\"width:100%;height:auto\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/write-593333_640.jpg\" />\r\n</div>\r\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\r\n<p>\r\nO-rizon ASL comporte également de nombreux outils permettant de gérer les élèves via le personnel de la vie scolaire en leur donnant des moyens simples d\'effectuer leur travail.\r\n<br />\r\nUn panneau de contrôle listant tous les élèves de l\'établissement, mais également la liste de tout le personnel de l\'établissement (professeurs, conseillers d\'orientation, personnel de l\'administration et de la vie scolaire et parents) permet d\'effectuer toutes les actions de la vie scolaire.\r\n<br />\r\nAinsi, des outils comme la gestion des absences ou des sanctions seront à portée de main pour le personnel de la vie scolaire.\r\n</p>\r\n</div>\r\n</div>\r\n</div>', 'Administration / Vie scolaire', '', 'publish', 'closed', 'closed', '', 'administration-vie-scolaire', '', '', '2018-08-07 18:19:28', '2018-08-07 16:19:28', '', 0, 'http://o-rizon.eu/?page_id=68', 0, 'page', '', 0),
(69, 1, '2018-06-29 11:29:26', '2018-06-29 09:29:26', '', 'Administration / Vie scolaire', '', 'inherit', 'closed', 'closed', '', '68-revision-v1', '', '', '2018-06-29 11:29:26', '2018-06-29 09:29:26', '', 68, 'http://o-rizon.eu/2018/06/29/68-revision-v1/', 0, 'revision', '', 0),
(70, 1, '2018-06-29 11:29:46', '2018-06-29 09:29:46', '<div class=\"container-fluid\">\r\n<div class=\"row\">\r\n<h2 style=\"text-align:center;\">Une plateforme numérique pour les professeurs</h2>\r\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\r\n<img style=\"width:100%;height:auto;\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/bag-1868758_640.jpg\" />\r\n</div>\r\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\r\n<p>\r\nO-rizon T donne des fonctionnalités de travail numérique aux professeurs afin de les assister dans leur quotidien. La plateforme n\'a pas pour objectif de désacraliser le métier de professeur mais au contraire de le bonifier grâce aux technologies en ligne actuelles.\r\n<br />\r\nCet apport d\'outils permet aux professionnels de l\'école de mieux communiquer avec leurs élèves ainsi qu\'à les aider dans leur réussite scolaire du mieux qu\'ils puissent le faire.\r\n<br />\r\nDes outils ergonomiques tels que la gestion du relevé de notes des élèves, la gestion des présences aux cours ainsi que la publication et le partage de cours en ligne sur un E-Learning dédié.\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n', 'Professeur', '', 'publish', 'closed', 'closed', '', 'professeur', '', '', '2018-08-07 18:17:51', '2018-08-07 16:17:51', '', 0, 'http://o-rizon.eu/?page_id=70', 0, 'page', '', 0),
(71, 1, '2018-06-29 11:29:46', '2018-06-29 09:29:46', '', 'Professeur', '', 'inherit', 'closed', 'closed', '', '70-revision-v1', '', '', '2018-06-29 11:29:46', '2018-06-29 09:29:46', '', 70, 'http://o-rizon.eu/2018/06/29/70-revision-v1/', 0, 'revision', '', 0),
(72, 1, '2018-06-29 11:30:13', '2018-06-29 09:30:13', '<div class=\"container-fluid\">\r\n<div class=\"row\">\r\n<h2 style=\"text-align:center;\">Une aide concrète pour les conseillers</h2>\r\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\r\n<img style=\"width:100%;height:auto;\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/business-3560929_640.jpg\" />\r\n</div>\r\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\r\n<p>\r\nO-rizon C offre une technologie nouvelle pour suivre les progrès des élèves ainsi que leurs intérêts personnels grâce à l\'intelligence  artificielle d\'O-rizon.\r\n<br />\r\nLe travail des conseillers d\'orientation est aidé grâce à des fonctionnalités de suivi complètes et des indicateurs graphiques précis.\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n', 'Conseiller d\'orientation', '', 'publish', 'closed', 'closed', '', 'conseiller-orientation', '', '', '2018-08-07 18:19:36', '2018-08-07 16:19:36', '', 0, 'http://o-rizon.eu/?page_id=72', 0, 'page', '', 0),
