(102, 1, '2018-06-29 17:51:06', '2018-06-29 15:51:06', '[md-form]\r\n\r\n[md-raw]\r\nVous avez la possibilité de demander un devis gratuit afin d\'établir un premier contact avec l\'équipe O-rizon.\r\n[/md-raw]\r\n\r\n[md-text label=\"Nom\"]\r\n[text* v-surname]\r\n[/md-text]\r\n\r\n[md-text label=\"Prénom\"]\r\n[text* v-name]\r\n[/md-text]\r\n\r\n[md-text label=\"Nom de l\'établissement\"]\r\n[text* v-school]\r\n[/md-text]\r\n\r\n[md-text label=\"Email\"]\r\n[email* v-email]\r\n[/md-text]\r\n\r\n[md-text label=\"Numéro de téléphone\"]\r\n[tel* v-tel]\r\n[/md-text]\r\n\r\n[md-select label=\"Taille de l\'établissement\"]\r\n[select* v-size \"Moins de 300 élèves\" \"Entre 300 et 800 élèves\" \"Plus de 800 élèves\"]\r\n[/md-select]\r\n\r\n[md-select label=\"Offre préférée\"]\r\n[select* v-type \"ENT\" \"ENT+\" \"ENTVS\"]\r\n[/md-select]\r\n\r\n[md-textarea label=\"Message\"]\r\n[textarea v-message]\r\n[/md-textarea]\r\n\r\n[md-submit]\r\n[submit \"Demander un devis\"]\r\n[/md-submit]\r\n\r\n[/md-form]\n1\n\n\norizon.dev@gmail.com\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nMerci pour votre message. Il a été envoyé.\nUne erreur s’est produite lors de l’envoi de votre message. Veuillez essayer à nouveau plus tard.\nUn ou plusieurs champs contiennent une erreur. Veuillez vérifier et essayer à nouveau.\nUne erreur s’est produite lors de l’envoi de votre message. Veuillez essayer à nouveau plus tard.\nVous devez accepter les termes et conditions avant d’envoyer votre message.\nCe champ est obligatoire.\nLe champ est trop long.\nLe champ est trop court.\nLe format de date est incorrect.\nLa date précède la première date autorisée.\nLa date est postérieure à la dernière date autorisée.\nUne erreur inconnue s’est produite lors du téléversement du fichier.\nVous n’avez pas les droits nécessaires pour téléverser ce type de fichier.\nLe fichier est trop volumineux.\nUne erreur s’est produite lors du téléversement du fichier.\nLe format du nombre est invalide.\nLe nombre est plus petit que le minimum autorisé.\nLe nombre est plus grand que le maximum autorisé.\nLa réponse à la question est incorrecte.\nLe code entré est incorrect.\nL’adresse e-mail n’est pas valide.\nL’URL n’est pas valide.\nLe numéro de téléphone n’est pas valide.\ndemo_mode: on', 'CF7 Live Preview (Do not use or delete this form)', '', 'publish', 'closed', 'closed', '', 'cf7-live-preview-do-not-use-or-delete-this-form', '', '', '2018-06-29 18:16:03', '2018-06-29 16:16:03', '', 0, 'http://o-rizon.eu/?p=102', 0, 'wpcf7_contact_form', '', 0);
