(98, 1, '2018-06-29 17:20:40', '2018-06-29 15:20:40', '<div class=\"col-md-5\">\r\n<h3>À propos de O-rizon</h3>\r\nO-rizon est une suite web comportant un espace numérique de travail de dernière génération, moderne et ergonomique afin de s’adapter aux besoins de ses utilisateurs. Un outil de suivi de l’orientation à long terme et personnalisé caractérisé par une intelligence artificielle puissante permet d’effacer les craintes des élèves par rapport à leur avenir.\r\n\r\n</div>\r\n<div class=\"col-md-6 col-md-offset-1\"><img class=\"size-medium alignright\" src=\"http://o-rizon.eu/wp-content/themes/hestia/assets/img/about-content.png\" /></div>', 'Accueil', '', 'inherit', 'closed', 'closed', '', '39-revision-v1', '', '', '2018-06-29 17:20:40', '2018-06-29 15:20:40', '', 39, 'http://o-rizon.eu/2018/06/29/39-revision-v1/', 0, 'revision', '', 0),
