(254, 1, '2018-08-07 18:19:28', '2018-08-07 16:19:28', '<div class=\"container-fluid\">\r\n<div class=\"row\">\r\n<h2 style=\"text-align:center;\">Une meilleure gestion de l\'établissement</h2>\r\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\r\n<img style=\"width:100%;height:auto;\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/achievement-3408115_640.jpg\" />\r\n</div>\r\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\r\n<p>\r\nO-rizon ASL a été conçu pour les collèges et lycées de France afin de leur permettre de pouvoir avoir une gestion de leur établissement améliorée et simplifiées grâce à des outils modernes et efficaces.\r\n<br />\r\nAvec O-rizon, les établissements vont en être en mesure de définir des années scolaires avec les périodes trimestrielles et de vacances adaptées mais également définir les matières enseignées au sein de l\'établissement et gérer tous les comptes liés.\r\n<br />\r\nAvec une ergonomie intuitive, la gestion du personnel et des élèves sera beaucoup plus facile qu\'auparavant. Les établissements peuvent créer des classes et y associer des professeurs ainsi que des élèves plus vite qu\'avec un autre logiciel.\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<hr />\r\n\r\n<div class=\"container-fluid\" style=\"margin-top:50px;\">\r\n<div class=\"row\">\r\n<h2 style=\"text-align:center;\">Une vie scolaire intégralement numérique</h2>\r\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\r\n<img style=\"width:100%;height:auto\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/write-593333_640.jpg\" />\r\n</div>\r\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\r\n<p>\r\nO-rizon ASL comporte également de nombreux outils permettant de gérer les élèves via le personnel de la vie scolaire en leur donnant des moyens simples d\'effectuer leur travail.\r\n<br />\r\nUn panneau de contrôle listant tous les élèves de l\'établissement, mais également la liste de tout le personnel de l\'établissement (professeurs, conseillers d\'orientation, personnel de l\'administration et de la vie scolaire et parents) permet d\'effectuer toutes les actions de la vie scolaire.\r\n<br />\r\nAinsi, des outils comme la gestion des absences ou des sanctions seront à portée de main pour le personnel de la vie scolaire.\r\n</p>\r\n</div>\r\n</div>\r\n</div>', 'Administration / Vie scolaire', '', 'inherit', 'closed', 'closed', '', '68-revision-v1', '', '', '2018-08-07 18:19:28', '2018-08-07 16:19:28', '', 68, 'http://o-rizon.eu/2018/08/07/68-revision-v1/', 0, 'revision', '', 0),
