(252, 1, '2018-08-07 18:17:43', '2018-08-07 16:17:43', '<div class=\"container-fluid\">\r\n<div class=\"row\">\r\n<h2 style=\"text-align:center;\">Les parents ont leur outil de suivi</h2>\r\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\r\n<img style=\"width:100%;height:auto;\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/men-2425121_640.jpg\" />\r\n</div>\r\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\r\n<p>\r\nO-rizon P donne aux parents d\'élèves des outils pour suivre la scolarité et la réussite globale de leurs enfants au moyen de fonctionnalités statistiques détaillées.\r\n<br />\r\nL\'application pour les parents utilisent également l\'intelligence artificielle d\'O-rizon et leur permet de suivre d\'un oeil intéressé les propositions d\'orientations faites à leurs enfants et comment ils interagisent avec ces propositions.\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n', 'Parent', '', 'inherit', 'closed', 'closed', '', '74-revision-v1', '', '', '2018-08-07 18:17:43', '2018-08-07 16:17:43', '', 74, 'http://o-rizon.eu/2018/08/07/74-revision-v1/', 0, 'revision', '', 0),
