(229, 1, '2018-07-26 17:24:52', '2018-07-26 15:24:52', '<div class=\"container-fluid\">\n<div class=\"row\">\n<h2 style=\"text-align:center;\">Une plateforme numérique pour les professeurs</h2>\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\n<img style=\"width:100%;height:auto;\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/student-849825_640-300x200.jpg\" />\n</div>\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\n<p>\nO-rizon Professeur donne des fonctionnalités de travail numérique aux professeurs afin de les assister dans leur quotidien. La plateforme n\'a pas pour objectif de désacraliser le métier de professeur mais au contraire de le bonifier grâce aux technologies en ligne actuelles.\n<br />\nCet apport d\'outils permet aux professionnels de l\'école de mieux communiquer avec leurs élèves ainsi qu\'à les aider dans leur réussite scolaire du mieux qu\'ils puissent le faire.\n<br />\nDes outils ergonomiques tels que la gestion du relevé de notes des élèves, la gestion des présences aux cours ainsi que la publication et le partage de cours en ligne sur un E-Learning dédié.\n</p>\n</div>\n</div>\n</div>\n', 'Professeur', '', 'inherit', 'closed', 'closed', '', '70-autosave-v1', '', '', '2018-07-26 17:24:52', '2018-07-26 15:24:52', '', 70, 'http://o-rizon.eu/2018/07/26/70-autosave-v1/', 0, 'revision', '', 0),
