(233, 1, '2018-07-26 15:39:00', '2018-07-26 13:39:00', '<div class=\"container-fluid\">\r\n<div class=\"row\">\r\n<h2>Une meilleure gestion de l\'établissement</h2>\r\n<p>\r\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\r\n<img style=\"width:100%;height:auto;\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/student-849825_640-300x200.jpg\" />\r\n</div>\r\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\r\nO-rizon Établissement a été conçu pour les collèges et lycées de France afin de leur permettre de pouvoir avoir une gestion de leur établissement améliorée et simplifiées grâce à des outils modernes et efficaces.\r\n<br />\r\nAvec O-rizon, les établissements vont en être en mesure de définir des années scolaires avec les périodes trimestrielles et de vacances adaptées mais également définir les matières enseignées au sein de l\'établissement et gérer tous les comptes liés.\r\n<br />\r\nAvec une ergonomie intuitive, la gestion du personnel et des élèves sera beaucoup plus facile qu\'auparavant. Les établissements peuvent créer des classes et y associer des professeurs ainsi que des élèves plus vite qu\'avec un autre logiciel.\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n', 'Administration / Vie scolaire', '', 'inherit', 'closed', 'closed', '', '68-revision-v1', '', '', '2018-07-26 15:39:00', '2018-07-26 13:39:00', '', 68, 'http://o-rizon.eu/2018/07/26/68-revision-v1/', 0, 'revision', '', 0),
