(240, 1, '2018-07-26 17:01:22', '2018-07-26 15:01:22', '<div class=\"container-fluid\">\r\n<div class=\"row\">\r\n<h2 style=\"text-align:center;\">Une meilleure gestion de l\'établissement</h2>\r\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\r\n<img style=\"width:100%;height:auto;\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/achievement-3408115_640.jpg\" />\r\n</div>\r\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\r\n<p>\r\nO-rizon Établissement a été conçu pour les collèges et lycées de France afin de leur permettre de pouvoir avoir une gestion de leur établissement améliorée et simplifiées grâce à des outils modernes et efficaces.\r\n<br />\r\nAvec O-rizon, les établissements vont en être en mesure de définir des années scolaires avec les périodes trimestrielles et de vacances adaptées mais également définir les matières enseignées au sein de l\'établissement et gérer tous les comptes liés.\r\n<br />\r\nAvec une ergonomie intuitive, la gestion du personnel et des élèves sera beaucoup plus facile qu\'auparavant. Les établissements peuvent créer des classes et y associer des professeurs ainsi que des élèves plus vite qu\'avec un autre logiciel.\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<hr />\r\n\r\n<div class=\"container-fluid\" style=\"margin-top:50px;\">\r\n<div class=\"row\">\r\n<h2 style=\"text-align:center;\">Une vie scolaire intégralement numérique</h2>\r\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\r\n<img style=\"width:100%;height:auto\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/write-593333_640.jpg\" />\r\n</div>\r\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\r\n<p>\r\nO-rizon Établissement comporte également de nombreux outils permettant de gérer les élèves via le personnel de la vie scolaire en leur donnant des moyens simples d\'effectuer leur travail.\r\n<br />\r\nUn panneau de contrôle listant tous les élèves de l\'établissement, mais également la liste de tout le personnel de l\'établissement (professeurs, conseillers d\'orientation, personnel de l\'administration et de la vie scolaire et parents) permet d\'effectuer toutes les actions de la vie scolaire.\r\n<br />\r\nAinsi, des outils comme la gestion des absences ou des sanctions seront à portée de main pour le personnel de la vie scolaire.\r\n</p>\r\n</div>\r\n</div>\r\n</div>', 'Administration / Vie scolaire', '', 'inherit', 'closed', 'closed', '', '68-revision-v1', '', '', '2018-07-26 17:01:22', '2018-07-26 15:01:22', '', 68, 'http://o-rizon.eu/2018/07/26/68-revision-v1/', 0, 'revision', '', 0),
(242, 1, '2018-07-26 17:27:13', '2018-07-26 15:27:13', '<div class=\"container-fluid\">\r\n<div class=\"row\">\r\n<h2 style=\"text-align:center;\">Une plateforme numérique pour les professeurs</h2>\r\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\r\n<img style=\"width:100%;height:auto;\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/bag-1868758_640.jpg\" />\r\n</div>\r\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\r\n<p>\r\nO-rizon Professeur donne des fonctionnalités de travail numérique aux professeurs afin de les assister dans leur quotidien. La plateforme n\'a pas pour objectif de désacraliser le métier de professeur mais au contraire de le bonifier grâce aux technologies en ligne actuelles.\r\n<br />\r\nCet apport d\'outils permet aux professionnels de l\'école de mieux communiquer avec leurs élèves ainsi qu\'à les aider dans leur réussite scolaire du mieux qu\'ils puissent le faire.\r\n<br />\r\nDes outils ergonomiques tels que la gestion du relevé de notes des élèves, la gestion des présences aux cours ainsi que la publication et le partage de cours en ligne sur un E-Learning dédié.\r\n</p>\r\n</div>\r\n</div>\r\n</div>\r\n', 'Professeur', '', 'inherit', 'closed', 'closed', '', '70-revision-v1', '', '', '2018-07-26 17:27:13', '2018-07-26 15:27:13', '', 70, 'http://o-rizon.eu/2018/07/26/70-revision-v1/', 0, 'revision', '', 0),
(243, 1, '2018-07-29 18:28:57', '2018-07-29 16:28:57', '<div class=\"container-fluid\">\n<div class=\"row\">\n<h2 style=\"text-align:center;\">Une aide concrète pour les conseillers</h2>\n<div class=\"col-xs-offset-2 col-xs-8\" style=\"padding-bottom:20px;\">\n<img style=\"width:100%;height:auto;\" src=\"http://o-rizon.eu/wp-content/uploads/2018/07/bag-1868758_640.jpg\" />\n</div>\n<div class=\"col-xs-12\" style=\"text-align:justify;\">\n<p>\nO-rizon Conseiller d\'Orientation offre une technologie nouvelle pour suivre les progrès des élèves ainsi que leurs intérêts personnels grâce à l\'intelligence  artificielle d\'O-rizon.\n<br />\nLe travail des conseillers d\'orientation est aidé grâce à des fonctionnalités de suivi complètes et des indicateurs graphiques précis.\n</p>\n</div>\n</div>\n</div>\n', 'Conseiller d\'orientation', '', 'inherit', 'closed', 'closed', '', '72-autosave-v1', '', '', '2018-07-29 18:28:57', '2018-07-29 16:28:57', '', 72, 'http://o-rizon.eu/2018/07/26/72-autosave-v1/', 0, 'revision', '', 0),
