(71, 1538828139, 1538828139, 'new', 'wfThemeUpgrade', 2, 'f9789e08f9ca67a6d3b8dd0b02ca7a17', 'f9789e08f9ca67a6d3b8dd0b02ca7a17', 'The Theme \"Hestia\" needs an upgrade (1.1.81 -> 2.0.5).', 'You need to upgrade \"Hestia\" to the newest version to ensure you have any security fixes the developer has released.', 'a:7:{s:10:\"newVersion\";s:5:\"2.0.5\";s:7:\"package\";s:54:\"https://downloads.wordpress.org/theme/hestia.2.0.5.zip\";s:3:\"URL\";s:36:\"https://wordpress.org/themes/hestia/\";s:4:\"Name\";s:6:\"Hestia\";s:4:\"name\";s:6:\"Hestia\";s:7:\"version\";s:6:\"1.1.81\";s:10:\"vulnerable\";b:0;}'),
